INSERT INTO `icd10` VALUES (888, 2, 1, 'B90-B94', 'Sequelae of infectious and parasitic diseases', NULL, NULL, NULL, NULL, NULL, NULL, '<div>\n				<p>Categories B90-B94 are to be used to indicate conditions in categories A00-B89 as the cause of sequelae, which are themselves classified elsewhere. The "sequelae" include conditions specified as such; they also include late effects of diseases classifiable to the above categories if there is evidence that the disease itself is no longer present. For use of these categories, reference should be made to the morbidity or mortality coding rules and guidelines in Volume 2.</p>\n				<p>Not to be used for chronic infections.  Code current infections to chronic or active infectious disease as appropriate.</p>\n			</div>\n');
