INSERT INTO `icd10` VALUES (1021, 3, 1020, 'C15', 'Malignant neoplasm of oesophagus', NULL, '059', '1-028', '2-026', '3-018', '4-016', '<div>\n				<p>Two alternative subclassifications are given:</p>\n				<ul>\n					<li>\n						<p>.0-.2 by anatomical description</p>\n					</li>\n					<li>\n						<p>.3-.5 by thirds</p>\n					</li>\n				</ul>\n				<p>This departure from the principle that categories should be mutually exclusive is deliberate, since both forms of terminology are in use but the resulting anatomical divisions are not analogous.</p>\n			</div>\n');
