INSERT INTO `icd10` VALUES (1495, 3, 1494, 'C97', 'Malignant neoplasms of independent (primary) multiple sites', NULL, '084', NULL, '2-044', NULL, '4-016', '<div>For use of this category, reference should be made to the mortality coding rules and guidelines in Volume 2.</div>\n');
INSERT INTO `icd10` VALUES (1496, 2, 939, 'D00-D09', 'In situ neoplasms', NULL, NULL, NULL, NULL, NULL, NULL, '<div>Many in situ neoplasms are regarded as being located within a continuum of morphological change between dysplasia and invasive cancer. For example, for cervical intraepithelial neoplasia (CIN) three grades are recognized, the third of which (CIN III) includes both severe dysplasia and carcinoma in situ. This system of grading has been extended to other organs, such as vulva and vagina. Descriptions of grade III intraepithelial neoplasia, with or without mention of severe dysplasia, are assigned to this section; grades I and II are classified as dysplasia of the organ system involved and should be coded to the relevant body system chapter.</div>\n');
