INSERT INTO `icd10` VALUES (2191, 2, 2033, 'E40-E46', 'Malnutrition', NULL, NULL, NULL, NULL, NULL, NULL, '<div>\n				<p>The degree of malnutrition is usually measured in terms of weight, expressed in standard deviations from the mean of the relevant reference population. When one or more previous measurements are available, lack of weight gain in children, or evidence of weight loss in children or adults, is usually indicative of malnutrition. When only one measurement is available, the diagnosis is based on probabilities and is not definitive without other clinical or laboratory tests. In the exceptional circumstances that no measurement of weight is available, reliance should be placed on clinical evidence.</p>\n				<p>If an observed weight is below the mean value of the reference population, there is a high probability of severe malnutrition if there is an observed value situated 3 or more standard deviations below the mean value of the reference population; a high probability of moderate malnutrition for an observed value located between 2 and less than 3 standard deviations below this mean; and a high probability of mild malnutrition for an observed value located between 1 and less than 2 standard deviations below this mean.</p>\n			</div>\n');
INSERT INTO `icd10` VALUES (2192, 3, 2191, 'E40', 'Kwashiorkor', NULL, '105', '1-053', '2-047', '3-024', '4-019', '<div>Severe malnutrition with nutritional oedema with dyspigmentation of skin and hair.</div>\n');
INSERT INTO `icd10` VALUES (2193, 3, 2191, 'E41', 'Nutritional marasmus', NULL, '105', '1-053', '2-047', '3-024', '4-019', NULL);
INSERT INTO `icd10` VALUES (2194, 3, 2191, 'E42', 'Marasmic kwashiorkor', NULL, '105', '1-053', '2-047', '3-024', '4-019', NULL);
INSERT INTO `icd10` VALUES (2195, 3, 2191, 'E43', 'Unspecified severe protein-energy malnutrition', NULL, '105', '1-053', '2-047', '3-024', '4-019', '<div>Severe loss of weight [wasting] in children or adults, or lack of weight gain in children leading to an observed weight that is at least 3 standard deviations below the mean value for the reference population (or a similar loss expressed through other statistical approaches). When only one measurement is available, there is a high probability of severe wasting when the observed weight is 3 or more standard deviations below the mean of the reference population.</div>\n');
INSERT INTO `icd10` VALUES (2196, 3, 2191, 'E44', 'Protein-energy malnutrition of moderate and mild degree', NULL, '105', '1-053', '2-047', '3-024', '4-019', NULL);
INSERT INTO `icd10` VALUES (2197, 4, 2196, 'E44.0', 'Moderate protein-energy malnutrition', NULL, '105', '1-053', '2-047', '3-024', '4-019', '<div>Weight loss in children or adults, or lack of weight gain in children leading to an observed weight that is 2 or more but less than 3 standard deviations below the mean value for the reference population (or a similar loss expressed through other statistical approaches). When only one measurement is available, there is a high probability of moderate protein-energy malnutrition when the observed weight is 2 or more but less than 3 standard deviations below the mean of the reference population.</div>\n');
INSERT INTO `icd10` VALUES (2198, 4, 2196, 'E44.1', 'Mild protein-energy malnutrition', NULL, '105', '1-053', '2-047', '3-024', '4-019', '<div>Weight loss in children or adults, or lack of weight gain in children leading to an observed weight that is 1 or more but less than 2 standard deviations below the mean value for the reference population (or a similar loss expresssed through other statistical approaches). When only one measurement is available, there is a high probability of mild protein-energy malnutrition when the observed weight is 1 or more but less than 2 standard deviations below the mean of the reference population.</div>\n');
INSERT INTO `icd10` VALUES (2199, 3, 2191, 'E45', 'Retarded development following protein-energy malnutrition', NULL, '105', '1-053', '2-047', '3-024', '4-019', NULL);
