INSERT INTO `icd10` VALUES (2393, 3, 2274, 'E89', 'Postprocedural endocrine and metabolic disorders, not elsewhere classified', NULL, '111', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `icd10` VALUES (2394, 4, 2393, 'E89.0', 'Postprocedural hypothyroidism', NULL, '111', NULL, NULL, NULL, NULL, NULL);
