INSERT INTO `icd10` VALUES (2396, 4, 2393, 'E89.2', 'Postprocedural hypoparathyroidism', NULL, '111', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `icd10` VALUES (2397, 4, 2393, 'E89.3', 'Postprocedural hypopituitarism', NULL, '111', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `icd10` VALUES (2398, 4, 2393, 'E89.4', 'Postprocedural ovarian failure', NULL, '111', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `icd10` VALUES (2399, 4, 2393, 'E89.5', 'Postprocedural testicular hypofunction', NULL, '111', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `icd10` VALUES (2400, 4, 2393, 'E89.6', 'Postprocedural adrenocortical(-medullary) hypofunction', NULL, '111', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `icd10` VALUES (2401, 4, 2393, 'E89.8', 'Other postprocedural endocrine and metabolic disorders', NULL, '111', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `icd10` VALUES (2402, 4, 2393, 'E89.9', 'Postprocedural endocrine and metabolic disorder, unspecified', NULL, '111', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `icd10` VALUES (2403, 3, 2274, 'E90', 'Nutritional and metabolic disorders in diseases classified elsewhere', NULL, '111', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `icd10` VALUES (2404, 1, NULL, 'V', 'Mental and behavioural disorders', NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `icd10` VALUES (2405, 2, 2404, 'F00-F09', 'Organic, including symptomatic, mental disorders', NULL, NULL, NULL, NULL, NULL, NULL, '<div>\n				<p>This block comprises a range of mental disorders grouped together on the basis of their having in common a demonstrable etiology in cerebral disease, brain injury, or other insult leading to cerebral dysfunction. The dysfunction may be primary, as in diseases, injuries, and insults that affect the brain directly and selectively; or secondary, as in systemic diseases and disorders that attack the brain only as one of the multiple organs or systems of the body that are involved.</p>\n				<p>Dementia (F00-F03) is a syndrome due to disease of the brain, usually of a chronic or progressive nature, in which there is disturbance of multiple higher cortical functions, including memory, thinking, orientation, comprehension, calculation, learning capacity, language, and judgement. Consciousness is not clouded. The impairments of cognitive function are commonly accompanied, and occasionally preceded, by deterioration in emotional control, social behaviour, or motivation. This syndrome occurs in Alzheimer disease, in cerebrovascular disease, and in other conditions primarily or secondarily affecting the brain.</p>\n			</div>\n');
INSERT INTO `icd10` VALUES (2406, 3, 2405, 'F00', 'Dementia in Alzheimer disease', NULL, '112', NULL, NULL, NULL, NULL, '<div>Alzheimer disease is a primary degenerative cerebral disease of unknown etiology with characteristic neuropathological and neurochemical features. The disorder is usually insidious in onset and develops slowly but steadily over a period of several years.</div>\n');
INSERT INTO `icd10` VALUES (2407, 4, 2406, 'F00.0', 'Dementia in Alzheimer disease with early onset', NULL, '112', NULL, NULL, NULL, NULL, '<div>Dementia in Alzheimer disease with onset before the age of 65, with a relatively rapid deteriorating course and with marked multiple disorders of the higher cortical functions.</div>\n');
INSERT INTO `icd10` VALUES (2408, 4, 2406, 'F00.1', 'Dementia in Alzheimer disease with late onset', NULL, '112', NULL, NULL, NULL, NULL, '<div>Dementia in Alzheimer disease with onset after the age of 65, usually in the late 70s or thereafter, with a slow progression, and with memory impairment as the principal feature.</div>\n');
INSERT INTO `icd10` VALUES (2409, 4, 2406, 'F00.2', 'Dementia in Alzheimer disease, atypical or mixed type', NULL, '112', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `icd10` VALUES (2410, 4, 2406, 'F00.9', 'Dementia in Alzheimer disease, unspecified', NULL, '112', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `icd10` VALUES (2411, 3, 2405, 'F01', 'Vascular dementia', NULL, '112', '1-057', '2-072', '3-059', '4-044', '<div>Vascular dementia is the result of infarction of the brain due to vascular disease, including hypertensive cerebrovascular disease. The infarcts are usually small but cumulative in their effect. Onset is usually in later life.</div>\n');
INSERT INTO `icd10` VALUES (2412, 4, 2411, 'F01.0', 'Vascular dementia of acute onset', NULL, '112', '1-057', '2-072', '3-059', '4-044', '<div>Usually develops rapidly after a succession of strokes from cerebrovascular thrombosis, embolism or haemorrhage. In rare cases, a single large infarction may be the cause.</div>\n');
INSERT INTO `icd10` VALUES (2413, 4, 2411, 'F01.1', 'Multi-infarct dementia', NULL, '112', '1-057', '2-072', '3-059', '4-044', '<div>Gradual in onset, following a number of transient ischaemic episodes which produce an accumulation of infarcts in the cerebral parenchyma.</div>\n');
INSERT INTO `icd10` VALUES (2414, 4, 2411, 'F01.2', 'Subcortical vascular dementia', NULL, '112', '1-057', '2-072', '3-059', '4-044', '<div>Includes cases with a history of hypertension and foci of ischaemic destruction in the deep white matter of the cerebral hemispheres. The cerebral cortex is usually preserved and this contrasts with the clinical picture which may closely resemble that of dementia in Alzheimer disease.</div>\n');
INSERT INTO `icd10` VALUES (2415, 4, 2411, 'F01.3', 'Mixed cortical and subcortical vascular dementia', NULL, '112', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2416, 4, 2411, 'F01.8', 'Other vascular dementia', NULL, '112', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2417, 4, 2411, 'F01.9', 'Vascular dementia, unspecified', NULL, '112', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2418, 3, 2405, 'F02', 'Dementia in other diseases classified elsewhere', NULL, '112', '1-057', '2-072', '3-059', '4-044', '<div>Cases of dementia due, or presumed to be due, to causes other than Alzheimer disease or cerebrovascular disease. Onset may be at any time in life, though rarely in old age.</div>\n');
INSERT INTO `icd10` VALUES (2419, 4, 2418, 'F02.0', 'Dementia in Pick disease', NULL, '112', '1-057', '2-072', '3-059', '4-044', '<div>A progressive dementia, commencing in middle age, characterized by early, slowly progressing changes of character and social deterioration, followed by impairment of intellect, memory, and language functions, with apathy, euphoria and, occasionally, extrapyramidal phenomena.</div>\n');
INSERT INTO `icd10` VALUES (2420, 4, 2418, 'F02.1', 'Dementia in Creutzfeldt-Jakob disease', NULL, '112', '1-057', '2-072', '3-059', '4-044', '<div>A progressive dementia with extensive neurological signs, due to specific neuropathological changes that are presumed to be caused by a transmissible agent. Onset is usually in middle or later life, but may be at any adult age. The course is subacute, leading to death within one to two years.</div>\n');
INSERT INTO `icd10` VALUES (2421, 4, 2418, 'F02.2', 'Dementia in Huntington disease', NULL, '112', '1-057', '2-072', '3-059', '4-044', '<div>A dementia occurring as part of a widespread degeneration of the brain. The disorder is transmitted by a single autosomal dominant gene. Symptoms typically emerge in the third and fourth decade. Progression is slow, leading to death usually within 10 to 15 years.</div>\n');
INSERT INTO `icd10` VALUES (2422, 4, 2418, 'F02.3', 'Dementia in Parkinson disease', NULL, '112', '1-057', '2-072', '3-059', '4-044', '<div>A dementia developing in the course of established Parkinson disease. No particular distinguishing clinical features have yet been demonstrated.</div>\n');
INSERT INTO `icd10` VALUES (2423, 4, 2418, 'F02.4', 'Dementia in human immunodeficiency virus [HIV] disease', NULL, '112', '1-057', '2-072', '3-059', '4-044', '<div>Dementia developing in the course of HIV disease, in the absence of a concurrent illness or condition other than HIV infection that could explain the clinical features.</div>\n');
INSERT INTO `icd10` VALUES (2424, 4, 2418, 'F02.8', 'Dementia in other specified diseases classified elsewhere', NULL, '112', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2425, 3, 2405, 'F03', 'Unspecified dementia', NULL, '112', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2426, 3, 2405, 'F04', 'Organic amnesic syndrome, not induced by alcohol and other psychoactive substances', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A syndrome of prominent impairment of recent and remote memory while immediate recall is preserved, with reduced ability to learn new material and disorientation in time. Confabulation may be a marked feature, but perception and other cognitive functions, including the intellect, are usually intact. The prognosis depends on the course of the underlying lesion.</div>\n');
INSERT INTO `icd10` VALUES (2427, 3, 2405, 'F05', 'Delirium, not induced by alcohol and other psychoactive substances', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>An etiologically nonspecific organic cerebral syndrome characterized by concurrent disturbances of consciousness and attention, perception, thinking, memory, psychomotor behaviour, emotion, and the sleep-wake schedule. The duration is variable and the degree of severity ranges from mild to very severe.</div>\n');
INSERT INTO `icd10` VALUES (2428, 4, 2427, 'F05.0', 'Delirium not superimposed on dementia, so described', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2429, 4, 2427, 'F05.1', 'Delirium superimposed on dementia', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2430, 4, 2427, 'F05.8', 'Other delirium', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2431, 4, 2427, 'F05.9', 'Delirium, unspecified', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2432, 3, 2405, 'F06', 'Other mental disorders due to brain damage and dysfunction and to physical disease', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Includes miscellaneous conditions causally related to brain disorder due to primary cerebral disease, to systemic disease affecting the brain secondarily, to exogenous toxic substances or hormones, to endocrine disorders, or to other somatic illnesses.</div>\n');
INSERT INTO `icd10` VALUES (2433, 4, 2432, 'F06.0', 'Organic hallucinosis', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A disorder of persistent or recurrent hallucinations, usually visual or auditory, that occur in clear consciousness and may or may not be recognized by the subject as such. Delusional elaboration of the hallucinations may occur, but delusions do not dominate the clinical picture; insight may be preserved.</div>\n');
INSERT INTO `icd10` VALUES (2434, 4, 2432, 'F06.1', 'Organic catatonic disorder', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A disorder of diminished (stupor) or increased (excitement) psychomotor activity associated with catatonic symptoms. The extremes of psychomotor disturbance may alternate.</div>\n');
INSERT INTO `icd10` VALUES (2435, 4, 2432, 'F06.2', 'Organic delusional [schizophrenia-like] disorder', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A disorder in which persistent or recurrent delusions dominate the clinical picture. The delusions may be accompanied by hallucinations. Some features suggestive of schizophrenia, such as bizarre hallucinations or thought disorder, may be present.</div>\n');
INSERT INTO `icd10` VALUES (2436, 4, 2432, 'F06.3', 'Organic mood [affective] disorders', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Disorders characterized by a change in mood or affect, usually accompanied by a change in the overall level of activity, depressive, hypomanic, manic or bipolar (see F30-F38), but arising as a consequence of an organic disorder.</div>\n');
INSERT INTO `icd10` VALUES (2437, 4, 2432, 'F06.4', 'Organic anxiety disorder', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A disorder characterized by the essential descriptive features of a generalized anxiety disorder (F41.1), a panic disorder (F41.0), or a combination of both, but arising as a consequence of an organic disorder.</div>\n');
INSERT INTO `icd10` VALUES (2438, 4, 2432, 'F06.5', 'Organic dissociative disorder', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A disorder characterized by a partial or complete loss of the normal integration between memories of the past, awareness of identity and immediate sensations, and control of bodily movements (see F44.-), but arising as a consequence of an organic disorder.</div>\n');
INSERT INTO `icd10` VALUES (2439, 4, 2432, 'F06.6', 'Organic emotionally labile [asthenic] disorder', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A disorder characterized by emotional incontinence or lability, fatigability, and a variety of unpleasant physical sensations (e.g. dizziness) and pains, but arising as a consequence of an organic disorder.</div>\n');
INSERT INTO `icd10` VALUES (2440, 4, 2432, 'F06.7', 'Mild cognitive disorder', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A disorder characterized by impairment of memory, learning difficulties, and reduced ability to concentrate on a task for more than brief periods. There is often a marked feeling of mental fatigue when mental tasks are attempted, and new learning is found to be subjectively difficult even when objectively successful. None of these symptoms is so severe that a diagnosis of either dementia (F00-F03) or delirium (F05.-) can be made. This diagnosis should be made only in association with a specified physical disorder, and should not be made in the presence of any of the mental or behavioural disorders classified to F10-F99. The disorder may precede, accompany, or follow a wide variety of infections and physical disorders, both cerebral and systemic, but direct evidence of cerebral involvement is not necessarily present. It can be differentiated from postencephalitic syndrome (F07.1) and postconcussional syndrome (F07.2) by its different etiology, more restricted range of generally milder symptoms, and usually shorter duration.</div>\n');
INSERT INTO `icd10` VALUES (2441, 4, 2432, 'F06.8', 'Other specified mental disorders due to brain damage and dysfunction and to physical disease', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2442, 4, 2432, 'F06.9', 'Unspecified mental disorder due to brain damage and dysfunction and to physical disease', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2443, 3, 2405, 'F07', 'Personality and behavioural disorders due to brain disease, damage and dysfunction', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Alteration of personality and behaviour can be a residual or concomitant disorder of brain disease, damage or dysfunction.</div>\n');
INSERT INTO `icd10` VALUES (2444, 4, 2443, 'F07.0', 'Organic personality disorder', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A disorder characterized by a significant alteration of the habitual patterns of behaviour displayed by the subject premorbidly, involving the expression of emotions, needs and impulses. Impairment of cognitive and thought functions, and altered sexuality may also be part of the clinical picture.</div>\n');
INSERT INTO `icd10` VALUES (2445, 4, 2443, 'F07.1', 'Postencephalitic syndrome', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Residual nonspecific and variable behavioural change following recovery from either viral or bacterial encephalitis. The principal difference between this disorder and the organic personality disorders is that it is reversible.</div>\n');
INSERT INTO `icd10` VALUES (2446, 4, 2443, 'F07.2', 'Postconcussional syndrome', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A syndrome that occurs following head trauma (usually sufficiently severe to result in loss of consciousness) and includes a number of disparate symptoms such as headache, dizziness, fatigue, irritability, difficulty in concentration and performing mental tasks, impairment of memory, insomnia, and reduced tolerance to stress, emotional excitement, or alcohol.</div>\n');
INSERT INTO `icd10` VALUES (2447, 4, 2443, 'F07.8', 'Other organic personality and behavioural disorders due to brain disease, damage and dysfunction', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2448, 4, 2443, 'F07.9', 'Unspecified organic personality and behavioural disorder due to brain disease, damage and dysfunction', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2449, 3, 2405, 'F09', 'Unspecified organic or symptomatic mental disorder', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2450, 2, 2404, 'F10-F19', 'Mental and behavioural disorders due to psychoactive substance use', NULL, NULL, NULL, NULL, NULL, NULL, '<div>\n				<p>This block contains a wide variety of disorders that differ in severity and clinical form but that are all attributable to the use of one or more psychoactive substances, which may or may not have been medically prescribed. The third character of the code identifies the substance involved, and the fourth character specifies the clinical state. The codes should be used, as required, for each substance specified, but it should be noted that not all fourth character codes are applicable to all substances.</p>\n				<p>Identification of the psychoactive substance should be based on as many sources of information as possible. These include self-report data, analysis of blood and other body fluids, characteristic physical and psychological symptoms, clinical signs and behaviour, and other evidence such as a drug being in the patient\'s possession or reports from informed third parties. Many drug users take more than one type of psychoactive substance. The main diagnosis should be classified, whenever possible, according to the substance or class of substances that has caused or contributed most to the presenting clinical syndrome. Other diagnoses should be coded when other psychoactive substances have been taken in intoxicating amounts (common fourth character .0) or to the extent of causing harm (common fourth character .1), dependence (common fourth character .2) or other disorders (common fourth character .3-.9).</p>\n				<p>Only in cases in which patterns of psychoactive substance-taking are chaotic and indiscriminate, or in which the contributions of different psychoactive substances are inextricably mixed, should the diagnosis of disorders resulting from multiple drug use (F19.-) be used.</p>\n			</div>\n');
INSERT INTO `icd10` VALUES (2451, 3, 2450, 'F10', 'Mental and behavioural disorders due to use of alcohol', NULL, '113', '1-056', '2-048', '3-059', '4-044', '<div>[See before F10 for subdivisions]</div>\n');
INSERT INTO `icd10` VALUES (2452, 3, 2450, 'F11', 'Mental and behavioural disorders due to use of opioids', NULL, '114', '1-056', '2-048', '3-059', '4-044', '<div>[See before F10 for subdivisions]</div>\n');
INSERT INTO `icd10` VALUES (2453, 3, 2450, 'F12', 'Mental and behavioural disorders due to use of cannabinoids', NULL, '114', '1-056', '2-048', '3-059', '4-044', '<div>[See before F10 for subdivisions]</div>\n');
INSERT INTO `icd10` VALUES (2454, 3, 2450, 'F13', 'Mental and behavioural disorders due to use of sedatives or hypnotics', NULL, '114', '1-056', '2-048', '3-059', '4-044', '<div>[See before F10 for subdivisions]</div>\n');
INSERT INTO `icd10` VALUES (2455, 3, 2450, 'F14', 'Mental and behavioural disorders due to use of cocaine', NULL, '114', '1-056', '2-048', '3-059', '4-044', '<div>[See before F10 for subdivisions]</div>\n');
INSERT INTO `icd10` VALUES (2456, 3, 2450, 'F15', 'Mental and behavioural disorders due to use of other stimulants, including caffeine', NULL, '114', '1-056', '2-048', '3-059', '4-044', '<div>[See before F10 for subdivisions]</div>\n');
INSERT INTO `icd10` VALUES (2457, 3, 2450, 'F16', 'Mental and behavioural disorders due to use of hallucinogens', NULL, '114', '1-056', '2-048', '3-059', '4-044', '<div>[See before F10 for subdivisions]</div>\n');
INSERT INTO `icd10` VALUES (2458, 3, 2450, 'F17', 'Mental and behavioural disorders due to use of tobacco', NULL, '114', '1-056', '2-048', '3-059', '4-044', '<div>[See before F10 for subdivisions]</div>\n');
INSERT INTO `icd10` VALUES (2459, 3, 2450, 'F18', 'Mental and behavioural disorders due to use of volatile solvents', NULL, '114', '1-056', '2-048', '3-059', '4-044', '<div>[See before F10 for subdivisions]</div>\n');
INSERT INTO `icd10` VALUES (2460, 3, 2450, 'F19', 'Mental and behavioural disorders due to multiple drug use and use of other psychoactive substances', NULL, '114', '1-056', '2-048', '3-059', '4-044', '<div>[See before F10 for subdivisions]</div>\n<div>This category should be used when two or more psychoactive substances are known to be involved, but it is impossible to assess which substance is contributing most to the disorders. It should also be used when the exact identity of some or even all the psychoactive substances being used is uncertain or unknown, since many multiple drug users themselves often do not know the details of what they are taking.</div>\n');
INSERT INTO `icd10` VALUES (2461, 2, 2404, 'F20-F29', 'Schizophrenia, schizotypal and delusional disorders', NULL, NULL, NULL, NULL, NULL, NULL, '<div>This block brings together schizophrenia, as the most important member of the group, schizotypal disorder, persistent delusional disorders, and a larger group of acute and transient psychotic disorders. Schizoaffective disorders have been retained here in spite of their controversial nature.</div>\n');
INSERT INTO `icd10` VALUES (2462, 3, 2461, 'F20', 'Schizophrenia', NULL, '115', '1-057', '2-072', '3-059', '4-044', '<div>\n				<p>The schizophrenic disorders are characterized in general by fundamental and characteristic distortions of thinking and perception, and affects that are inappropriate or blunted. Clear consciousness and intellectual capacity are usually maintained although certain cognitive deficits may evolve in the course of time. The most important psychopathological phenomena include thought echo; thought insertion or withdrawal; thought broadcasting; delusional perception and delusions of control; influence or passivity; hallucinatory voices commenting or discussing the patient in the third person; thought disorders and negative symptoms.</p>\n				<p>The course of schizophrenic disorders can be either continuous, or episodic with progressive or stable deficit, or there can be one or more episodes with complete or incomplete remission. The diagnosis of schizophrenia should not be made in the presence of extensive depressive or manic symptoms unless it is clear that schizophrenic symptoms antedate the affective disturbance. Nor should schizophrenia be diagnosed in the presence of overt brain disease or during states of drug intoxication or withdrawal. Similar disorders developing in the presence of epilepsy or other brain disease should be classified under F06.2, and those induced by psychoactive substances under F10-F19 with common fourth character .5.</p>\n			</div>\n');
INSERT INTO `icd10` VALUES (2463, 4, 2462, 'F20.0', 'Paranoid schizophrenia', NULL, '115', '1-057', '2-072', '3-059', '4-044', '<div>Paranoid schizophrenia is dominated by relatively stable, often paranoid delusions, usually accompanied by hallucinations, particularly of the auditory variety, and perceptual disturbances. Disturbances of affect, volition and speech, and catatonic symptoms, are either absent or relatively inconspicuous.</div>\n');
INSERT INTO `icd10` VALUES (2464, 4, 2462, 'F20.1', 'Hebephrenic schizophrenia', NULL, '115', '1-057', '2-072', '3-059', '4-044', '<div>A form of schizophrenia in which affective changes are prominent, delusions and hallucinations fleeting and fragmentary, behaviour irresponsible and unpredictable, and mannerisms common. The mood is shallow and inappropriate, thought is disorganized, and speech is incoherent. There is a tendency to social isolation. Usually the prognosis is poor because of the rapid development of "negative" symptoms, particularly flattening of affect and loss of volition. Hebephrenia should normally be diagnosed only in adolescents or young adults.</div>\n');
INSERT INTO `icd10` VALUES (2465, 4, 2462, 'F20.2', 'Catatonic schizophrenia', NULL, '115', '1-057', '2-072', '3-059', '4-044', '<div>Catatonic schizophrenia is dominated by prominent psychomotor disturbances that may alternate between extremes such as hyperkinesis and stupor, or automatic obedience and negativism. Constrained attitudes and postures may be maintained for long periods. Episodes of violent excitement may be a striking feature of the condition. The catatonic phenomena may be combined with a dream-like (oneiroid) state with vivid scenic hallucinations.</div>\n');
INSERT INTO `icd10` VALUES (2466, 4, 2462, 'F20.3', 'Undifferentiated schizophrenia', NULL, '115', '1-057', '2-072', '3-059', '4-044', '<div>Psychotic conditions meeting the general diagnostic criteria for schizophrenia but not conforming to any of the subtypes in F20.0-F20.2, or exhibiting the features of more than one of them without a clear predominance of a particular set of diagnostic characteristics.</div>\n');
INSERT INTO `icd10` VALUES (2467, 4, 2462, 'F20.4', 'Post-schizophrenic depression', NULL, '115', '1-057', '2-072', '3-059', '4-044', '<div>A depressive episode, which may be prolonged, arising in the aftermath of a schizophrenic illness. Some schizophrenic symptoms, either "positive" or "negative", must still be present but they no longer dominate the clinical picture. These depressive states are associated with an increased risk of suicide. If the patient no longer has any schizophrenic symptoms, a depressive episode should be diagnosed (F32.-). If schizophrenic symptoms are still florid and prominent, the diagnosis should remain that of the appropriate schizophrenic subtype (F20.0-F20.3).</div>\n');
INSERT INTO `icd10` VALUES (2468, 4, 2462, 'F20.5', 'Residual schizophrenia', NULL, '115', '1-057', '2-072', '3-059', '4-044', '<div>A chronic stage in the development of a schizophrenic illness in which there has been a clear progression from an early stage to a later stage characterized by long- term, though not necessarily irreversible, "negative" symptoms, e.g. psychomotor slowing; underactivity; blunting of affect; passivity and lack of initiative; poverty of quantity or content of speech; poor nonverbal communication by facial expression, eye contact, voice modulation and posture; poor self-care and social performance.</div>\n');
INSERT INTO `icd10` VALUES (2469, 4, 2462, 'F20.6', 'Simple schizophrenia', NULL, '115', '1-057', '2-072', '3-059', '4-044', '<div>A disorder in which there is an insidious but progressive development of oddities of conduct, inability to meet the demands of society, and decline in total performance. The characteristic negative features of residual schizophrenia (e.g. blunting of affect and loss of volition) develop without being preceded by any overt psychotic symptoms.</div>\n');
INSERT INTO `icd10` VALUES (2470, 4, 2462, 'F20.8', 'Other schizophrenia', NULL, '115', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2471, 4, 2462, 'F20.9', 'Schizophrenia, unspecified', NULL, '115', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2472, 3, 2461, 'F21', 'Schizotypal disorder', NULL, '115', '1-057', '2-072', '3-059', '4-044', '<div>A disorder characterized by eccentric behaviour and anomalies of thinking and affect which resemble those seen in schizophrenia, though no definite and characteristic schizophrenic anomalies occur at any stage. The symptoms may include a cold or inappropriate affect; anhedonia; odd or eccentric behaviour; a tendency to social withdrawal; paranoid or bizarre ideas not amounting to true delusions; obsessive ruminations; thought disorder and perceptual disturbances; occasional transient quasi-psychotic episodes with intense illusions, auditory or other hallucinations, and delusion-like ideas, usually occurring without external provocation. There is no definite onset and evolution and course are usually those of a personality disorder.</div>\n');
INSERT INTO `icd10` VALUES (2473, 3, 2461, 'F22', 'Persistent delusional disorders', NULL, '115', '1-057', '2-072', '3-059', '4-044', '<div>Includes a variety of disorders in which long-standing delusions constitute the only, or the most conspicuous, clinical characteristic and which cannot be classified as organic, schizophrenic or affective. Delusional disorders that have lasted for less than a few months should be classified, at least temporarily, under F23.-.</div>\n');
INSERT INTO `icd10` VALUES (2474, 4, 2473, 'F22.0', 'Delusional disorder', NULL, '115', '1-057', '2-072', '3-059', '4-044', '<div>A disorder characterized by the development either of a single delusion or of a set of related delusions that are usually persistent and sometimes lifelong. The content of the delusion or delusions is very variable. Clear and persistent auditory hallucinations (voices), schizophrenic symptoms such as delusions of control and marked blunting of affect, and definite evidence of brain disease are all incompatible with this diagnosis. However, the presence of occasional or transitory auditory hallucinations, particularly in elderly patients, does not rule out this diagnosis, provided that they are not typically schizophrenic and form only a small part of the overall clinical picture.</div>\n');
INSERT INTO `icd10` VALUES (2475, 4, 2473, 'F22.8', 'Other persistent delusional disorders', NULL, '115', '1-057', '2-072', '3-059', '4-044', '<div>Disorders in which the delusion or delusions are accompanied by persistent hallucinatory voices or by schizophrenic symptoms that do not justify a diagnosis of schizophrenia (F20.-).</div>\n');
INSERT INTO `icd10` VALUES (2476, 4, 2473, 'F22.9', 'Persistent delusional disorder, unspecified', NULL, '115', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2477, 3, 2461, 'F23', 'Acute and transient psychotic disorders', NULL, '115', '1-057', '2-072', '3-059', '4-044', '<div>A heterogeneous group of disorders characterized by the acute onset of psychotic symptoms such as delusions, hallucinations, and perceptual disturbances, and by the severe disruption of ordinary behaviour. Acute onset is defined as a crescendo development of a clearly abnormal clinical picture in about two weeks or less. For these disorders there is no evidence of organic causation. Perplexity and puzzlement are often present but disorientation for time, place and person is not persistent or severe enough to justify a diagnosis of organically caused delirium (F05.-). Complete recovery usually occurs within a few months, often within a few weeks or even days. If the disorder persists, a change in classification will be necessary. The disorder may or may not be associated with acute stress, defined as usually stressful events preceding the onset by one to two weeks.</div>\n');
INSERT INTO `icd10` VALUES (2478, 4, 2477, 'F23.0', 'Acute polymorphic psychotic disorder without symptoms of schizophrenia', NULL, '115', '1-057', '2-072', '3-059', '4-044', '<div>An acute psychotic disorder in which hallucinations, delusions or perceptual disturbances are obvious but markedly variable, changing from day to day or even from hour to hour. Emotional turmoil with intense transient feelings of happiness or ecstasy, or anxiety and irritability, is also frequently present. The polymorphism and instability are characteristic for the overall clinical picture and the psychotic features do not justify a diagnosis of schizophrenia (F20.-). These disorders often have an abrupt onset, developing rapidly within a few days, and they frequently show a rapid resolution of symptoms with no recurrence. If the symptoms persist the diagnosis should be changed to persistent delusional disorder (F22.-).</div>\n');
INSERT INTO `icd10` VALUES (2479, 4, 2477, 'F23.1', 'Acute polymorphic psychotic disorder with symptoms of schizophrenia', NULL, '115', '1-057', '2-072', '3-059', '4-044', '<div>An acute psychotic disorder in which the polymorphic and unstable clinical picture is present, as described in F23.0; despite this instability, however, some symptoms typical of schizophrenia are also in evidence for the majority of the time. If the schizophrenic symptoms persist the diagnosis should be changed to schizophrenia (F20.-).</div>\n');
INSERT INTO `icd10` VALUES (2480, 4, 2477, 'F23.2', 'Acute schizophrenia-like psychotic disorder', NULL, '115', '1-057', '2-072', '3-059', '4-044', '<div>An acute psychotic disorder in which the psychotic symptoms are comparatively stable and justify a diagnosis of schizophrenia, but have lasted for less than about one month; the polymorphic unstable features, as described in F23.0, are absent. If the schizophrenic symptoms persist the diagnosis should be changed to schizophrenia (F20.-).</div>\n');
INSERT INTO `icd10` VALUES (2481, 4, 2477, 'F23.3', 'Other acute predominantly delusional psychotic disorders', NULL, '115', '1-057', '2-072', '3-059', '4-044', '<div>Acute psychotic disorders in which comparatively stable delusions or hallucinations are the main clinical features, but do not justify a diagnosis of schizophrenia (F20.-). If the delusions persist the diagnosis should be changed to persistent delusional disorder (F22.-).</div>\n');
INSERT INTO `icd10` VALUES (2482, 4, 2477, 'F23.8', 'Other acute and transient psychotic disorders', NULL, '115', '1-057', '2-072', '3-059', '4-044', '<div>Any other specified acute psychotic disorders for which there is no evidence of organic causation and which do not justify classification to F23.0-F23.3.</div>\n');
INSERT INTO `icd10` VALUES (2483, 4, 2477, 'F23.9', 'Acute and transient psychotic disorder, unspecified', NULL, '115', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2484, 3, 2461, 'F24', 'Induced delusional disorder', NULL, '115', '1-057', '2-072', '3-059', '4-044', '<div>A delusional disorder shared by two or more people with close emotional links. Only one of the people suffers from a genuine psychotic disorder; the delusions are induced in the other(s) and usually disappear when the people are separated.</div>\n');
INSERT INTO `icd10` VALUES (2485, 3, 2461, 'F25', 'Schizoaffective disorders', NULL, '115', '1-057', '2-072', '3-059', '4-044', '<div>Episodic disorders in which both affective and schizophrenic symptoms are prominent but which do not justify a diagnosis of either schizophrenia or depressive or manic episodes. Other conditions in which affective symptoms are superimposed on a pre-existing schizophrenic illness, or co-exist or alternate with persistent delusional disorders of other kinds, are classified under F20-F29. Mood-incongruent psychotic symptoms in affective disorders do not justify a diagnosis of schizoaffective disorder.</div>\n');
INSERT INTO `icd10` VALUES (2486, 4, 2485, 'F25.0', 'Schizoaffective disorder, manic type', NULL, '115', '1-057', '2-072', '3-059', '4-044', '<div>A disorder in which both schizophrenic and manic symptoms are prominent so that the episode of illness does not justify a diagnosis of either schizophrenia or a manic episode. This category should be used for both a single episode and a recurrent disorder in which the majority of episodes are schizoaffective, manic type.</div>\n');
INSERT INTO `icd10` VALUES (2487, 4, 2485, 'F25.1', 'Schizoaffective disorder, depressive type', NULL, '115', '1-057', '2-072', '3-059', '4-044', '<div>A disorder in which both schizophrenic and depressive symptoms are prominent so that the episode of illness does not justify a diagnosis of either schizophrenia or a depressive episode. This category should be used for both a single episode and a recurrent disorder in which the majority of episodes are schizoaffective, depressive type.</div>\n');
INSERT INTO `icd10` VALUES (2488, 4, 2485, 'F25.2', 'Schizoaffective disorder, mixed type', NULL, '115', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2489, 4, 2485, 'F25.8', 'Other schizoaffective disorders', NULL, '115', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2490, 4, 2485, 'F25.9', 'Schizoaffective disorder, unspecified', NULL, '115', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2491, 3, 2461, 'F28', 'Other nonorganic psychotic disorders', NULL, '115', '1-057', '2-072', '3-059', '4-044', '<div>Delusional or hallucinatory disorders that do not justify a diagnosis of schizophrenia (F20.-), persistent delusional disorders (F22.-), acute and transient psychotic disorders (F23.-), psychotic types of manic episode (F30.2), or severe depressive episode (F32.3).</div>\n');
INSERT INTO `icd10` VALUES (2492, 3, 2461, 'F29', 'Unspecified nonorganic psychosis', NULL, '115', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2493, 2, 2404, 'F30-F39', 'Mood [affective] disorders', NULL, NULL, NULL, NULL, NULL, NULL, '<div>This block contains disorders in which the fundamental disturbance is a change in affect or mood to depression (with or without associated anxiety) or to elation. The mood change is usually accompanied by a change in the overall level of activity; most of the other symptoms are either secondary to, or easily understood in the context of, the change in mood and activity. Most of these disorders tend to be recurrent and the onset of individual episodes can often be related to stressful events or situations.</div>\n');
INSERT INTO `icd10` VALUES (2494, 3, 2493, 'F30', 'Manic episode', NULL, '116', '1-057', '2-072', '3-059', '4-044', '<div>All the subdivisions of this category should be used only for a single episode. Hypomanic or manic episodes in individuals who have had one or more previous affective episodes (depressive, hypomanic, manic, or mixed) should be coded as bipolar affective disorder (F31.-).</div>\n');
INSERT INTO `icd10` VALUES (2495, 4, 2494, 'F30.0', 'Hypomania', NULL, '116', '1-057', '2-072', '3-059', '4-044', '<div>A disorder characterized by a persistent mild elevation of mood, increased energy and activity, and usually marked feelings of well-being and both physical and mental efficiency. Increased sociability, talkativeness, over-familiarity, increased sexual energy, and a decreased need for sleep are often present but not to the extent that they lead to severe disruption of work or result in social rejection. Irritability, conceit, and boorish behaviour may take the place of the more usual euphoric sociability. The disturbances of mood and behaviour are not accompanied by hallucinations or delusions.</div>\n');
INSERT INTO `icd10` VALUES (2496, 4, 2494, 'F30.1', 'Mania without psychotic symptoms', NULL, '116', '1-057', '2-072', '3-059', '4-044', '<div>Mood is elevated out of keeping with the patient\'s circumstances and may vary from carefree joviality to almost uncontrollable excitement. Elation is accompanied by increased energy, resulting in overactivity, pressure of speech, and a decreased need for sleep. Attention cannot be sustained, and there is often marked distractibility. Self-esteem is often inflated with grandiose ideas and overconfidence. Loss of normal social inhibitions may result in behaviour that is reckless, foolhardy, or inappropriate to the circumstances, and out of character.</div>\n');
INSERT INTO `icd10` VALUES (2497, 4, 2494, 'F30.2', 'Mania with psychotic symptoms', NULL, '116', '1-057', '2-072', '3-059', '4-044', '<div>In addition to the clinical picture described in F30.1, delusions (usually grandiose) or hallucinations (usually of voices speaking directly to the patient) are present, or the excitement, excessive motor activity, and flight of ideas are so extreme that the subject is incomprehensible or inaccessible to ordinary communication.</div>\n');
INSERT INTO `icd10` VALUES (2498, 4, 2494, 'F30.8', 'Other manic episodes', NULL, '116', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2499, 4, 2494, 'F30.9', 'Manic episode, unspecified', NULL, '116', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2500, 3, 2493, 'F31', 'Bipolar affective disorder', NULL, '116', '1-057', '2-072', '3-059', '4-044', '<div>A disorder characterized by two or more episodes in which the patient\'s mood and activity levels are significantly disturbed, this disturbance consisting on some occasions of an elevation of mood and increased energy and activity (hypomania or mania) and on others of a lowering of mood and decreased energy and activity (depression). Repeated episodes of hypomania or mania only are classified as bipolar.</div>\n');
INSERT INTO `icd10` VALUES (2501, 4, 2500, 'F31.0', 'Bipolar affective disorder, current episode hypomanic', NULL, '116', '1-057', '2-072', '3-059', '4-044', '<div>The patient is currently hypomanic, and has had at least one other affective episode (hypomanic, manic, depressive, or mixed) in the past.</div>\n');
INSERT INTO `icd10` VALUES (2502, 4, 2500, 'F31.1', 'Bipolar affective disorder, current episode manic without psychotic symptoms', NULL, '116', '1-057', '2-072', '3-059', '4-044', '<div>The patient is currently manic, without psychotic symptoms (as in F30.1), and has had at least one other affective episode (hypomanic, manic, depressive, or mixed) in the past.</div>\n');
INSERT INTO `icd10` VALUES (2503, 4, 2500, 'F31.2', 'Bipolar affective disorder, current episode manic with psychotic symptoms', NULL, '116', '1-057', '2-072', '3-059', '4-044', '<div>The patient is currently manic, with psychotic symptoms (as in F30.2), and has had at least one other affective episode (hypomanic, manic, depressive, or mixed) in the past.</div>\n');
INSERT INTO `icd10` VALUES (2504, 4, 2500, 'F31.3', 'Bipolar affective disorder, current episode mild or moderate depression', NULL, '116', '1-057', '2-072', '3-059', '4-044', '<div>The patient is currently depressed, as in a depressive episode of either mild or moderate severity (F32.0 or F32.1), and has had at least one authenticated hypomanic, manic, or mixed affective episode in the past.</div>\n');
INSERT INTO `icd10` VALUES (2505, 4, 2500, 'F31.4', 'Bipolar affective disorder, current episode severe depression without psychotic symptoms', NULL, '116', '1-057', '2-072', '3-059', '4-044', '<div>The patient is currently depressed, as in severe depressive episode without psychotic symptoms (F32.2), and has had at least one authenticated hypomanic, manic, or mixed affective episode in the past.</div>\n');
INSERT INTO `icd10` VALUES (2506, 4, 2500, 'F31.5', 'Bipolar affective disorder, current episode severe depression with psychotic symptoms', NULL, '116', '1-057', '2-072', '3-059', '4-044', '<div>The patient is currently depressed, as in severe depressive episode with psychotic symptoms (F32.3), and has had at least one authenticated hypomanic, manic, or mixed affective episode in the past.</div>\n');
INSERT INTO `icd10` VALUES (2507, 4, 2500, 'F31.6', 'Bipolar affective disorder, current episode mixed', NULL, '116', '1-057', '2-072', '3-059', '4-044', '<div>The patient has had at least one authenticated hypomanic, manic, depressive, or mixed affective episode in the past, and currently exhibits either a mixture or a rapid alteration of manic and depressive symptoms.</div>\n');
INSERT INTO `icd10` VALUES (2508, 4, 2500, 'F31.7', 'Bipolar affective disorder, currently in remission', NULL, '116', '1-057', '2-072', '3-059', '4-044', '<div>The patient has had at least one authenticated hypomanic, manic, or mixed affective episode in the past, and at least one other affective episode (hypomanic, manic, depressive, or mixed) in addition, but is not currently suffering from any significant mood disturbance, and has not done so for several months. Periods of remission during prophylactic treatment should be coded here.</div>\n');
INSERT INTO `icd10` VALUES (2509, 4, 2500, 'F31.8', 'Other bipolar affective disorders', NULL, '116', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2510, 4, 2500, 'F31.9', 'Bipolar affective disorder, unspecified', NULL, '116', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2511, 3, 2493, 'F32', 'Depressive episode', NULL, '116', '1-057', '2-072', '3-059', '4-044', '<div>In typical mild, moderate, or severe depressive episodes, the patient suffers from lowering of mood, reduction of energy, and decrease in activity. Capacity for enjoyment, interest, and concentration is reduced, and marked tiredness after even minimum effort is common. Sleep is usually disturbed and appetite diminished. Self-esteem and self-confidence are almost always reduced and, even in the mild form, some ideas of guilt or worthlessness are often present. The lowered mood varies little from day to day, is unresponsive to circumstances and may be accompanied by so-called "somatic" symptoms, such as loss of interest and pleasurable feelings, waking in the morning several hours before the usual time, depression worst in the morning, marked psychomotor retardation, agitation, loss of appetite, weight loss, and loss of libido. Depending upon the number and severity of the symptoms, a depressive episode may be specified as mild, moderate or severe.</div>\n');
INSERT INTO `icd10` VALUES (2512, 4, 2511, 'F32.0', 'Mild depressive episode', NULL, '116', '1-057', '2-072', '3-059', '4-044', '<div>Two or three of the above symptoms are usually present. The patient is usually distressed by these but will probably be able to continue with most activities.</div>\n');
INSERT INTO `icd10` VALUES (2513, 4, 2511, 'F32.1', 'Moderate depressive episode', NULL, '116', '1-057', '2-072', '3-059', '4-044', '<div>Four or more of the above symptoms are usually present and the patient is likely to have great difficulty in continuing with ordinary activities.</div>\n');
INSERT INTO `icd10` VALUES (2514, 4, 2511, 'F32.2', 'Severe depressive episode without psychotic symptoms', NULL, '116', '1-057', '2-072', '3-059', '4-044', '<div>An episode of depression in which several of the above symptoms are marked and distressing, typically loss of self-esteem and ideas of worthlessness or guilt. Suicidal thoughts and acts are common and a number of "somatic" symptoms are usually present.</div>\n');
INSERT INTO `icd10` VALUES (2515, 4, 2511, 'F32.3', 'Severe depressive episode with psychotic symptoms', NULL, '116', '1-057', '2-072', '3-059', '4-044', '<div>An episode of depression as described in F32.2, but with the presence of hallucinations, delusions, psychomotor retardation, or stupor so severe that ordinary social activities are impossible; there may be danger to life from suicide, dehydration, or starvation. The hallucinations and delusions may or may not be mood-congruent.</div>\n');
INSERT INTO `icd10` VALUES (2516, 4, 2511, 'F32.8', 'Other depressive episodes', NULL, '116', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2517, 4, 2511, 'F32.9', 'Depressive episode, unspecified', NULL, '116', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2518, 3, 2493, 'F33', 'Recurrent depressive disorder', NULL, '116', '1-057', '2-072', '3-059', '4-044', '<div>A disorder characterized by repeated episodes of depression as described for depressive episode (F32.-), without any history of independent episodes of mood elevation and increased energy (mania). There may, however, be brief episodes of mild mood elevation and overactivity (hypomania) immediately after a depressive episode, sometimes precipitated by antidepressant treatment. The more severe forms of recurrent depressive disorder (F33.2 and F33.3) have much in common with earlier concepts such as manic-depressive depression, melancholia, vital depression and endogenous depression. The first episode may occur at any age from childhood to old age, the onset may be either acute or insidious, and the duration varies from a few weeks to many months. The risk that a patient with recurrent depressive disorder will have an episode of mania never disappears completely, however many depressive episodes have been experienced. If such an episode does occur, the diagnosis should be changed to bipolar affective disorder (F31.-).</div>\n');
INSERT INTO `icd10` VALUES (2519, 4, 2518, 'F33.0', 'Recurrent depressive disorder, current episode mild', NULL, '116', '1-057', '2-072', '3-059', '4-044', '<div>A disorder characterized by repeated episodes of depression, the current episode being mild, as in F32.0, and without any history of mania.</div>\n');
INSERT INTO `icd10` VALUES (2520, 4, 2518, 'F33.1', 'Recurrent depressive disorder, current episode moderate', NULL, '116', '1-057', '2-072', '3-059', '4-044', '<div>A disorder characterized by repeated episodes of depression, the current episode being of moderate severity, as in F32.1, and without any history of mania.</div>\n');
INSERT INTO `icd10` VALUES (2521, 4, 2518, 'F33.2', 'Recurrent depressive disorder, current episode severe without psychotic symptoms', NULL, '116', '1-057', '2-072', '3-059', '4-044', '<div>A disorder characterized by repeated episodes of depression, the current episode being severe without psychotic symptoms, as in F32.2, and without any history of mania.</div>\n');
INSERT INTO `icd10` VALUES (2522, 4, 2518, 'F33.3', 'Recurrent depressive disorder, current episode severe with psychotic symptoms', NULL, '116', '1-057', '2-072', '3-059', '4-044', '<div>A disorder characterized by repeated episodes of depression, the current episode being severe with psychotic symptoms, as in F32.3, and with no previous episodes of mania.</div>\n');
INSERT INTO `icd10` VALUES (2523, 4, 2518, 'F33.4', 'Recurrent depressive disorder, currently in remission', NULL, '116', '1-057', '2-072', '3-059', '4-044', '<div>The patient has had two or more depressive episodes as described in F33.0-F33.3, in the past, but has been free from depressive symptoms for several months.</div>\n');
INSERT INTO `icd10` VALUES (2524, 4, 2518, 'F33.8', 'Other recurrent depressive disorders', NULL, '116', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2525, 4, 2518, 'F33.9', 'Recurrent depressive disorder, unspecified', NULL, '116', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2526, 3, 2493, 'F34', 'Persistent mood [affective] disorders', NULL, '116', '1-057', '2-072', '3-059', '4-044', '<div>Persistent and usually fluctuating disorders of mood in which the majority of the individual episodes are not sufficiently severe to warrant being described as hypomanic or mild depressive episodes. Because they last for many years, and sometimes for the greater part of the patient\'s adult life, they involve considerable distress and disability. In some instances, recurrent or single manic or depressive episodes may become superimposed on a persistent affective disorder.</div>\n');
INSERT INTO `icd10` VALUES (2527, 4, 2526, 'F34.0', 'Cyclothymia', NULL, '116', '1-057', '2-072', '3-059', '4-044', '<div>A persistent instability of mood involving numerous periods of depression and mild elation, none of which is sufficiently severe or prolonged to justify a diagnosis of bipolar affective disorder (F31.-) or recurrent depressive disorder (F33.-). This disorder is frequently found in the relatives of patients with bipolar affective disorder. Some patients with cyclothymia eventually develop bipolar affective disorder.</div>\n');
INSERT INTO `icd10` VALUES (2528, 4, 2526, 'F34.1', 'Dysthymia', NULL, '116', '1-057', '2-072', '3-059', '4-044', '<div>A chronic depression of mood, lasting at least several years, which is not sufficiently severe, or in which individual episodes are not sufficiently prolonged, to justify a diagnosis of severe, moderate, or mild recurrent depressive disorder (F33.-).</div>\n');
INSERT INTO `icd10` VALUES (2529, 4, 2526, 'F34.8', 'Other persistent mood [affective] disorders', NULL, '116', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2530, 4, 2526, 'F34.9', 'Persistent mood [affective] disorder, unspecified', NULL, '116', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2531, 3, 2493, 'F38', 'Other mood [affective] disorders', NULL, '116', '1-057', '2-072', '3-059', '4-044', '<div>Any other mood disorders that do not justify classification to F30-F34, because they are not of sufficient severity or duration.</div>\n');
INSERT INTO `icd10` VALUES (2532, 4, 2531, 'F38.0', 'Other single mood [affective] disorders', NULL, '116', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2533, 4, 2531, 'F38.1', 'Other recurrent mood [affective] disorders', NULL, '116', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2534, 4, 2531, 'F38.8', 'Other specified mood [affective] disorders', NULL, '116', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2535, 3, 2493, 'F39', 'Unspecified mood [affective] disorder', NULL, '116', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2536, 2, 2404, 'F40-F48', 'Neurotic, stress-related and somatoform disorders', NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `icd10` VALUES (2537, 3, 2536, 'F40', 'Phobic anxiety disorders', NULL, '117', '1-057', '2-072', '3-059', '4-044', '<div>A group of disorders in which anxiety is evoked only, or predominantly, in certain well-defined situations that are not currently dangerous. As a result these situations are characteristically avoided or endured with dread. The patient\'s concern may be focused on individual symptoms like palpitations or feeling faint and is often associated with secondary fears of dying, losing control, or going mad. Contemplating entry to the phobic situation usually generates anticipatory anxiety. Phobic anxiety and depression often coexist. Whether two diagnoses, phobic anxiety and depressive episode, are needed, or only one, is determined by the time course of the two conditions and by therapeutic considerations at the time of consultation.</div>\n');
INSERT INTO `icd10` VALUES (2538, 4, 2537, 'F40.0', 'Agoraphobia', NULL, '117', '1-057', '2-072', '3-059', '4-044', '<div>A fairly well-defined cluster of phobias embracing fears of leaving home, entering shops, crowds and public places, or travelling alone in trains, buses or planes. Panic disorder is a frequent feature of both present and past episodes. Depressive and obsessional symptoms and social phobias are also commonly present as subsidiary features. Avoidance of the phobic situation is often prominent, and some agoraphobics experience little anxiety because they are able to avoid their phobic situations.</div>\n');
INSERT INTO `icd10` VALUES (2539, 4, 2537, 'F40.1', 'Social phobias', NULL, '117', '1-057', '2-072', '3-059', '4-044', '<div>Fear of scrutiny by other people leading to avoidance of social situations. More pervasive social phobias are usually associated with low self-esteem and fear of criticism. They may present as a complaint of blushing, hand tremor, nausea, or urgency of micturition, the patient sometimes being convinced that one of these secondary manifestations of their anxiety is the primary problem. Symptoms may progress to panic attacks.</div>\n');
INSERT INTO `icd10` VALUES (2540, 4, 2537, 'F40.2', 'Specific (isolated) phobias', NULL, '117', '1-057', '2-072', '3-059', '4-044', '<div>Phobias restricted to highly specific situations such as proximity to particular animals, heights, thunder, darkness, flying, closed spaces, urinating or defecating in public toilets, eating certain foods, dentistry, or the sight of blood or injury. Though the triggering situation is discrete, contact with it can evoke panic as in agoraphobia or social phobia.</div>\n');
INSERT INTO `icd10` VALUES (2541, 4, 2537, 'F40.8', 'Other phobic anxiety disorders', NULL, '117', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2542, 4, 2537, 'F40.9', 'Phobic anxiety disorder, unspecified', NULL, '117', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2543, 3, 2536, 'F41', 'Other anxiety disorders', NULL, '117', '1-057', '2-072', '3-059', '4-044', '<div>Disorders in which manifestation of anxiety is the major symptom and is not restricted to any particular environmental situation. Depressive and obsessional symptoms, and even some elements of phobic anxiety, may also be present, provided that they are clearly secondary or less severe.</div>\n');
INSERT INTO `icd10` VALUES (2544, 4, 2543, 'F41.0', 'Panic disorder [episodic paroxysmal anxiety]', NULL, '117', '1-057', '2-072', '3-059', '4-044', '<div>The essential feature is recurrent attacks of severe anxiety (panic), which are not restricted to any particular situation or set of circumstances and are therefore unpredictable. As with other anxiety disorders, the dominant symptoms include sudden onset of palpitations, chest pain, choking sensations, dizziness, and feelings of unreality (depersonalization or derealization). There is often also a secondary fear of dying, losing control, or going mad. Panic disorder should not be given as the main diagnosis if the patient has a depressive disorder at the time the attacks start; in these circumstances the panic attacks are probably secondary to depression.</div>\n');
INSERT INTO `icd10` VALUES (2545, 4, 2543, 'F41.1', 'Generalized anxiety disorder', NULL, '117', '1-057', '2-072', '3-059', '4-044', '<div>Anxiety that is generalized and persistent but not restricted to, or even strongly predominating in, any particular environmental circumstances (i.e. it is "free-floating"). The dominant symptoms are variable but include complaints of persistent nervousness, trembling, muscular tensions, sweating, lightheadedness, palpitations, dizziness, and epigastric discomfort. Fears that the patient or a relative will shortly become ill or have an accident are often expressed.</div>\n');
INSERT INTO `icd10` VALUES (2546, 4, 2543, 'F41.2', 'Mixed anxiety and depressive disorder', NULL, '117', '1-057', '2-072', '3-059', '4-044', '<div>This category should be used when symptoms of anxiety and depression are both present, but neither is clearly predominant, and neither type of symptom is present to the extent that justifies a diagnosis if considered separately. When both anxiety and depressive symptoms are present and severe enough to justify individual diagnoses, both diagnoses should be recorded and this category should not be used.</div>\n');
INSERT INTO `icd10` VALUES (2547, 4, 2543, 'F41.3', 'Other mixed anxiety disorders', NULL, '117', '1-057', '2-072', '3-059', '4-044', '<div>Symptoms of anxiety mixed with features of other disorders in F42-F48. Neither type of symptom is severe enough to justify a diagnosis if considered separately.</div>\n');
INSERT INTO `icd10` VALUES (2548, 4, 2543, 'F41.8', 'Other specified anxiety disorders', NULL, '117', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2549, 4, 2543, 'F41.9', 'Anxiety disorder, unspecified', NULL, '117', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2550, 3, 2536, 'F42', 'Obsessive-compulsive disorder', NULL, '117', '1-057', '2-072', '3-059', '4-044', '<div>The essential feature is recurrent obsessional thoughts or compulsive acts. Obsessional thoughts are ideas, images, or impulses that enter the patient\'s mind again and again in a stereotyped form. They are almost invariably distressing and the patient often tries, unsuccessfully, to resist them. They are, however, recognized as his or her own thoughts, even though they are involuntary and often repugnant. Compulsive acts or rituals are stereotyped behaviours that are repeated again and again. They are not inherently enjoyable, nor do they result in the completion of inherently useful tasks. Their function is to prevent some objectively unlikely event, often involving harm to or caused by the patient, which he or she fears might otherwise occur. Usually, this behaviour is recognized by the patient as pointless or ineffectual and repeated attempts are made to resist. Anxiety is almost invariably present. If compulsive acts are resisted the anxiety gets worse.</div>\n');
INSERT INTO `icd10` VALUES (2551, 4, 2550, 'F42.0', 'Predominantly obsessional thoughts or ruminations', NULL, '117', '1-057', '2-072', '3-059', '4-044', '<div>These may take the form of ideas, mental images, or impulses to act, which are nearly always distressing to the subject. Sometimes the ideas are an indecisive, endless consideration of alternatives, associated with an inability to make trivial but necessary decisions in day-to-day living. The relationship between obsessional ruminations and depression is particularly close and a diagnosis of obsessive-compulsive disorder should be preferred only if ruminations arise or persist in the absence of a depressive episode.</div>\n');
INSERT INTO `icd10` VALUES (2552, 4, 2550, 'F42.1', 'Predominantly compulsive acts [obsessional rituals]', NULL, '117', '1-057', '2-072', '3-059', '4-044', '<div>The majority of compulsive acts are concerned with cleaning (particularly handwashing), repeated checking to ensure that a potentially dangerous situation has not been allowed to develop, or orderliness and tidiness. Underlying the overt behaviour is a fear, usually of danger either to or caused by the patient, and the ritual is an ineffectual or symbolic attempt to avert that danger.</div>\n');
INSERT INTO `icd10` VALUES (2553, 4, 2550, 'F42.2', 'Mixed obsessional thoughts and acts', NULL, '117', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2554, 4, 2550, 'F42.8', 'Other obsessive-compulsive disorders', NULL, '117', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2555, 4, 2550, 'F42.9', 'Obsessive-compulsive disorder, unspecified', NULL, '117', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2556, 3, 2536, 'F43', 'Reaction to severe stress, and adjustment disorders', NULL, '117', '1-057', '2-072', '3-059', '4-044', '<div>This category differs from others in that it includes disorders identifiable on the basis of not only symptoms and course but also the existence of one or other of two causative influences: an exceptionally stressful life event producing an acute stress reaction, or a significant life change leading to continued unpleasant circumstances that result in an adjustment disorder. Although less severe psychosocial stress ("life events") may precipitate the onset or contribute to the presentation of a very wide range of disorders classified elsewhere in this chapter, its etiological importance is not always clear and in each case will be found to depend on individual, often idiosyncratic, vulnerability, i.e. the life events are neither necessary nor sufficient to explain the occurrence and form of the disorder. In contrast, the disorders brought together here are thought to arise always as a direct consequence of acute severe stress or continued trauma. The stressful events or the continuing unpleasant circumstances are the primary and overriding causal factor and the disorder would not have occurred without their impact. The disorders in this section can thus be regarded as maladaptive responses to severe or continued stress, in that they interfere with successful coping mechanisms and therefore lead to problems of social functioning.</div>\n');
INSERT INTO `icd10` VALUES (2557, 4, 2556, 'F43.0', 'Acute stress reaction', NULL, '117', '1-057', '2-072', '3-059', '4-044', '<div>A transient disorder that develops in an individual without any other apparent mental disorder in response to exceptional physical and mental stress and that usually subsides within hours or days. Individual vulnerability and coping capacity play a role in the occurrence and severity of acute stress reactions. The symptoms show a typically mixed and changing picture and include an initial state of "daze" with some constriction of the field of consciousness and narrowing of attention, inability to comprehend stimuli, and disorientation. This state may be followed either by further withdrawal from the surrounding situation (to the extent of a dissociative stupor - F44.2), or by agitation and over-activity (flight reaction or fugue). Autonomic signs of panic anxiety (tachycardia, sweating, flushing) are commonly present. The symptoms usually appear within minutes of the impact of the stressful stimulus or event, and disappear within two to three days (often within hours). Partial or complete amnesia (F44.0) for the episode may be present. If the symptoms persist, a change in diagnosis should be considered.</div>\n');
INSERT INTO `icd10` VALUES (2558, 4, 2556, 'F43.1', 'Post-traumatic stress disorder', NULL, '117', '1-057', '2-072', '3-059', '4-044', '<div>Arises as a delayed or protracted response to a stressful event or situation (of either brief or long duration) of an exceptionally threatening or catastrophic nature, which is likely to cause pervasive distress in almost anyone. Predisposing factors, such as personality traits (e.g. compulsive, asthenic) or previous history of neurotic illness, may lower the threshold for the development of the syndrome or aggravate its course, but they are neither necessary nor sufficient to explain its occurrence. Typical features include episodes of repeated reliving of the trauma in intrusive memories ("flashbacks"), dreams or nightmares, occurring against the persisting background of a sense of "numbness" and emotional blunting, detachment from other people, unresponsiveness to surroundings, anhedonia, and avoidance of activities and situations reminiscent of the trauma. There is usually a state of autonomic hyperarousal with hypervigilance, an enhanced startle reaction, and insomnia. Anxiety and depression are commonly associated with the above symptoms and signs, and suicidal ideation is not infrequent. The onset follows the trauma with a latency period that may range from a few weeks to months. The course is fluctuating but recovery can be expected in the majority of cases. In a small proportion of cases the condition may follow a chronic course over many years, with eventual transition to an enduring personality change (F62.0).</div>\n');
INSERT INTO `icd10` VALUES (2559, 4, 2556, 'F43.2', 'Adjustment disorders', NULL, '117', '1-057', '2-072', '3-059', '4-044', '<div>States of subjective distress and emotional disturbance, usually interfering with social functioning and performance, arising in the period of adaptation to a significant life change or a stressful life event. The stressor may have affected the integrity of an individual\'s social network (bereavement, separation experiences) or the wider system of social supports and values (migration, refugee status), or represented a major developmental transition or crisis (going to school, becoming a parent, failure to attain a cherished personal goal, retirement). Individual predisposition or vulnerability plays an important role in the risk of occurrence and the shaping of the manifestations of adjustment disorders, but it is nevertheless assumed that the condition would not have arisen without the stressor. The manifestations vary and include depressed mood, anxiety or worry (or mixture of these), a feeling of inability to cope, plan ahead, or continue in the present situation, as well as some degree of disability in 9the performance of daily routine. Conduct disorders may be an associated feature, particularly in adolescents. The predominant feature may be a brief or prolonged depressive reaction, or a disturbance of other emotions and conduct.</div>\n');
INSERT INTO `icd10` VALUES (2560, 4, 2556, 'F43.8', 'Other reactions to severe stress', NULL, '117', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2561, 4, 2556, 'F43.9', 'Reaction to severe stress, unspecified', NULL, '117', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2562, 3, 2536, 'F44', 'Dissociative [conversion] disorders', NULL, '117', '1-057', '2-072', '3-059', '4-044', '<div>The common themes that are shared by dissociative or conversion disorders are a partial or complete loss of the normal integration between memories of the past, awareness of identity and immediate sensations, and control of bodily movements. All types of dissociative disorders tend to remit after a few weeks or months, particularly if their onset is associated with a traumatic life event. More chronic disorders, particularly paralyses and anaesthesias, may develop if the onset is associated with insoluble problems or interpersonal difficulties. These disorders have previously been classified as various types of "conversion hysteria". They are presumed to be psychogenic in origin, being associated closely in time with traumatic events, insoluble and intolerable problems, or disturbed relationships. The symptoms often represent the patient\'s concept of how a physical illness would be manifest. Medical examination and investigation do not reveal the presence of any known physical or neurological disorder. In addition, there is evidence that the loss of function is an expression of emotional conflicts or needs. The symptoms may develop in close relationship to psychological stress, and often appear suddenly. Only disorders of physical functions normally under voluntary control and loss of sensations are included here. Disorders involving pain and other complex physical sensations mediated by the autonomic nervous system are classified under somatization disorder (F45.0). The possibility of the later appearance of serious physical or psychiatric disorders should always be kept in mind.</div>\n');
INSERT INTO `icd10` VALUES (2563, 4, 2562, 'F44.0', 'Dissociative amnesia', NULL, '117', '1-057', '2-072', '3-059', '4-044', '<div>The main feature is loss of memory, usually of important recent events, that is not due to organic mental disorder, and is too great to be explained by ordinary forgetfulness or fatigue. The amnesia is usually centred on traumatic events, such as accidents or unexpected bereavements, and is usually partial and selective. Complete and generalized amnesia is rare, and is usually part of a fugue (F44.1). If this is the case, the disorder should be classified as such. The diagnosis should not be made in the presence of organic brain disorders, intoxication, or excessive fatigue.</div>\n');
INSERT INTO `icd10` VALUES (2564, 4, 2562, 'F44.1', 'Dissociative fugue', NULL, '117', '1-057', '2-072', '3-059', '4-044', '<div>Dissociative fugue has all the features of dissociative amnesia, plus purposeful travel beyond the usual everyday range. Although there is amnesia for the period of the fugue, the patient\'s behaviour during this time may appear completely normal to independent observers.</div>\n');
INSERT INTO `icd10` VALUES (2565, 4, 2562, 'F44.2', 'Dissociative stupor', NULL, '117', '1-057', '2-072', '3-059', '4-044', '<div>Dissociative stupor is diagnosed on the basis of a profound diminution or absence of voluntary movement and normal responsiveness to external stimuli such as light, noise, and touch, but examination and investigation reveal no evidence of a physical cause. In addition, there is positive evidence of psychogenic causation in the form of recent stressful events or problems.</div>\n');
INSERT INTO `icd10` VALUES (2566, 4, 2562, 'F44.3', 'Trance and possession disorders', NULL, '117', '1-057', '2-072', '3-059', '4-044', '<div>Disorders in which there is a temporary loss of the sense of personal identity and full awareness of the surroundings. Include here only trance states that are involuntary or unwanted, occurring outside religious or culturally accepted situations.</div>\n');
INSERT INTO `icd10` VALUES (2567, 4, 2562, 'F44.4', 'Dissociative motor disorders', NULL, '117', '1-057', '2-072', '3-059', '4-044', '<div>In the commonest varieties there is loss of ability to move the whole or a part of a limb or limbs. There may be close resemblance to almost any variety of ataxia, apraxia, akinesia, aphonia, dysarthria, dyskinesia, seizures, or paralysis.</div>\n');
INSERT INTO `icd10` VALUES (2568, 4, 2562, 'F44.5', 'Dissociative convulsions', NULL, '117', '1-057', '2-072', '3-059', '4-044', '<div>Dissociative convulsions may mimic epileptic seizures very closely in terms of movements, but tongue-biting, bruising due to falling, and incontinence of urine are rare, and consciousness is maintained or replaced by a state of stupor or trance.</div>\n');
INSERT INTO `icd10` VALUES (2569, 4, 2562, 'F44.6', 'Dissociative anaesthesia and sensory loss', NULL, '117', '1-057', '2-072', '3-059', '4-044', '<div>Anaesthetic areas of skin often have boundaries that make it clear that they are associated with the patient\'s ideas about bodily functions, rather than medical knowledge. There may be differential loss between the sensory modalities which cannot be due to a neurological lesion. Sensory loss may be accompanied by complaints of paraesthesia. Loss of vision and hearing are rarely total in dissociative disorders.</div>\n');
INSERT INTO `icd10` VALUES (2570, 4, 2562, 'F44.7', 'Mixed dissociative [conversion] disorders', NULL, '117', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2571, 4, 2562, 'F44.8', 'Other dissociative [conversion] disorders', NULL, '117', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2572, 4, 2562, 'F44.9', 'Dissociative [conversion] disorder, unspecified', NULL, '117', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2573, 3, 2536, 'F45', 'Somatoform disorders', NULL, '117', '1-057', '2-072', '3-059', '4-044', '<div>The main feature is repeated presentation of physical symptoms together with persistent requests for medical investigations, in spite of repeated negative findings and reassurances by doctors that the symptoms have no physical basis. If any physical disorders are present, they do not explain the nature and extent of the symptoms or the distress and preoccupation of the patient.</div>\n');
INSERT INTO `icd10` VALUES (2574, 4, 2573, 'F45.0', 'Somatization disorder', NULL, '117', '1-057', '2-072', '3-059', '4-044', '<div>The main features are multiple, recurrent and frequently changing physical symptoms of at least two years duration. Most patients have a long and complicated history of contact with both primary and specialist medical care services, during which many negative investigations or fruitless exploratory operations may have been carried out. Symptoms may be referred to any part or system of the body. The course of the disorder is chronic and fluctuating, and is often associated with disruption of social, interpersonal, and family behaviour. Short-lived (less than two years) and less striking symptom patterns should be classified under undifferentiated somatoform disorder (F45.1).</div>\n');
INSERT INTO `icd10` VALUES (2575, 4, 2573, 'F45.1', 'Undifferentiated somatoform disorder', NULL, '117', '1-057', '2-072', '3-059', '4-044', '<div>When somatoform complaints are multiple, varying and persistent, but the complete and typical clinical picture of somatization disorder is not fulfilled, the diagnosis of undifferentiated somatoform disorder should be considered.</div>\n');
INSERT INTO `icd10` VALUES (2576, 4, 2573, 'F45.2', 'Hypochondriacal disorder', NULL, '117', '1-057', '2-072', '3-059', '4-044', '<div>The essential feature is a persistent preoccupation with the possibility of having one or more serious and progressive physical disorders. Patients manifest persistent somatic complaints or a persistent preoccupation with their physical appearance. Normal or commonplace sensations and appearances are often interpreted by patients as abnormal and distressing, and attention is usually focused upon only one or two organs or systems of the body. Marked depression and anxiety are often present, and may justify additional diagnoses.</div>\n');
INSERT INTO `icd10` VALUES (2577, 4, 2573, 'F45.3', 'Somatoform autonomic dysfunction', NULL, '117', '1-057', '2-072', '3-059', '4-044', '<div>Symptoms are presented by the patient as if they were due to a physical disorder of a system or organ that is largely or completely under autonomic innervation and control, i.e. the cardiovascular, gastrointestinal, respiratory and urogenital systems. The symptoms are usually of two types, neither of which indicates a physical disorder of the organ or system concerned. First, there are complaints based upon objective signs of autonomic arousal, such as palpitations, sweating, flushing, tremor, and expression of fear and distress about the possibility of a physical disorder. Second, there are subjective complaints of a nonspecific or changing nature such as fleeting aches and pains, sensations of burning, heaviness, tightness, and feelings of being bloated or distended, which are referred by the patient to a specific organ or system.</div>\n');
INSERT INTO `icd10` VALUES (2578, 4, 2573, 'F45.4', 'Persistent somatoform pain disorder', NULL, '117', '1-057', '2-072', '3-059', '4-044', '<div>The predominant complaint is of persistent, severe, and distressing pain, which cannot be explained fully by a physiological process or a physical disorder, and which occurs in association with emotional conflict or psychosocial problems that are sufficient to allow the conclusion that they are the main causative influences. The result is usually a marked increase in support and attention, either personal or medical. Pain presumed to be of psychogenic origin occurring during the course of depressive disorders or schizophrenia should not be included here.</div>\n');
INSERT INTO `icd10` VALUES (2579, 4, 2573, 'F45.8', 'Other somatoform disorders', NULL, '117', '1-057', '2-072', '3-059', '4-044', '<div>Any other disorders of sensation, function and behaviour, not due to physical disorders, which are not mediated through the autonomic nervous system, which are limited to specific systems or parts of the body, and which are closely associated in time with stressful events or problems.</div>\n');
INSERT INTO `icd10` VALUES (2580, 4, 2573, 'F45.9', 'Somatoform disorder, unspecified', NULL, '117', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2581, 3, 2536, 'F48', 'Other neurotic disorders', NULL, '117', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2582, 4, 2581, 'F48.0', 'Neurasthenia', NULL, '117', '1-057', '2-072', '3-059', '4-044', '<div>Considerable cultural variations occur in the presentation of this disorder, and two main types occur, with substantial overlap. In one type, the main feature is a complaint of increased fatigue after mental effort, often associated with some decrease in occupational performance or coping efficiency in daily tasks. The mental fatiguability is typically described as an unpleasant intrusion of distracting associations or recollections, difficulty in concentrating, and generally inefficient thinking. In the other type, the emphasis is on feelings of bodily or physical weakness and exhaustion after only minimal effort, accompanied by a feeling of muscular aches and pains and inability to relax. In both types a variety of other unpleasant physical feelings is common, such as dizziness, tension headaches, and feelings of general instability. Worry about decreasing mental and bodily well-being, irritability, anhedonia, and varying minor degrees of both depression and anxiety are all common. Sleep is often disturbed in its initial and middle phases but hypersomnia may also be prominent.</div>\n');
INSERT INTO `icd10` VALUES (2583, 4, 2581, 'F48.1', 'Depersonalization-derealization syndrome', NULL, '117', '1-057', '2-072', '3-059', '4-044', '<div>A rare disorder in which the patient complains spontaneously that his or her mental activity, body, and surroundings are changed in their quality, so as to be unreal, remote, or automatized. Among the varied phenomena of the syndrome, patients complain most frequently of loss of emotions and feelings of estrangement or detachment from their thinking, their body, or the real world. In spite of the dramatic nature of the experience, the patient is aware of the unreality of the change. The sensorium is normal and the capacity for emotional expression intact. Depersonalization-derealization symptoms may occur as part of a diagnosable schizophrenic, depressive, phobic, or obsessive-compulsive disorder. In such cases the diagnosis should be that of the main disorder.</div>\n');
INSERT INTO `icd10` VALUES (2584, 4, 2581, 'F48.8', 'Other specified neurotic disorders', NULL, '117', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2585, 4, 2581, 'F48.9', 'Neurotic disorder, unspecified', NULL, '117', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2586, 2, 2404, 'F50-F59', 'Behavioural syndromes associated with physiological disturbances and physical factors', NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `icd10` VALUES (2587, 3, 2586, 'F50', 'Eating disorders', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2588, 4, 2587, 'F50.0', 'Anorexia nervosa', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A disorder characterized by deliberate weight loss, induced and sustained by the patient. It occurs most commonly in adolescent girls and young women, but adolescent boys and young men may also be affected, as may children approaching puberty and older women up to the menopause. The disorder is associated with a specific psychopathology whereby a dread of fatness and flabbiness of body contour persists as an intrusive overvalued idea, and the patients impose a low weight threshold on themselves. There is usually undernutrition of varying severity with secondary endocrine and metabolic changes and disturbances of bodily function. The symptoms include restricted dietary choice, excessive exercise, induced vomiting and purgation, and use of appetite suppressants and diuretics.</div>\n');
INSERT INTO `icd10` VALUES (2589, 4, 2587, 'F50.1', 'Atypical anorexia nervosa', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Disorders that fulfil some of the features of anorexia nervosa but in which the overall clinical picture does not justify that diagnosis. For instance, one of the key symptoms, such as amenorrhoea or marked dread of being fat, may be absent in the presence of marked weight loss and weight-reducing behaviour. This diagnosis should not be made in the presence of known physical disorders associated with weight loss.</div>\n');
INSERT INTO `icd10` VALUES (2590, 4, 2587, 'F50.2', 'Bulimia nervosa', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A syndrome characterized by repeated bouts of overeating and an excessive preoccupation with the control of body weight, leading to a pattern of overeating followed by vomiting or use of purgatives. This disorder shares many psychological features with anorexia nervosa, including an overconcern with body shape and weight. Repeated vomiting is likely to give rise to disturbances of body electrolytes and physical complications. There is often, but not always, a history of an earlier episode of anorexia nervosa, the interval ranging from a few months to several years.</div>\n');
INSERT INTO `icd10` VALUES (2591, 4, 2587, 'F50.3', 'Atypical bulimia nervosa', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Disorders that fulfil some of the features of bulimia nervosa, but in which the overall clinical picture does not justify that diagnosis. For instance, there may be recurrent bouts of overeating and overuse of purgatives without significant weight change, or the typical overconcern about body shape and weight may be absent.</div>\n');
INSERT INTO `icd10` VALUES (2592, 4, 2587, 'F50.4', 'Overeating associated with other psychological disturbances', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Overeating due to stressful events, such as bereavement, accident, childbirth, etc.</div>\n');
INSERT INTO `icd10` VALUES (2593, 4, 2587, 'F50.5', 'Vomiting associated with other psychological disturbances', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Repeated vomiting that occurs in dissociative disorders (F44.-) and hypochondriacal disorder (F45.2), and that is not solely due to conditions classified outside this chapter. This subcategory may also be used in addition to O21.- (excessive vomiting in pregnancy) when emotional factors are predominant in the causation of recurrent nausea and vomiting in pregnancy.</div>\n');
INSERT INTO `icd10` VALUES (2594, 4, 2587, 'F50.8', 'Other eating disorders', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2595, 4, 2587, 'F50.9', 'Eating disorder, unspecified', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2596, 3, 2586, 'F51', 'Nonorganic sleep disorders', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>In many cases, a disturbance of sleep is one of the symptoms of another disorder, either mental or physical. Whether a sleep disorder in a given patient is an independent condition or simply one of the features of another disorder classified elsewhere, either in this chapter or in others, should be determined on the basis of its clinical presentation and course as well as on the therapeutic considerations and priorities at the time of the consultation. Generally, if the sleep disorder is one of the major complaints and is perceived as a condition in itself, the present code should be used along with other pertinent diagnoses describing the psychopathology and pathophysiology involved in a given case. This category includes only those sleep disorders in which emotional causes are considered to be a primary factor, and which are not due to identifiable physical disorders classified elsewhere.</div>\n');
INSERT INTO `icd10` VALUES (2597, 4, 2596, 'F51.0', 'Nonorganic insomnia', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A condition of unsatisfactory quantity and/or quality of sleep, which persists for a considerable period of time, including difficulty falling asleep, difficulty staying asleep, or early final wakening. Insomnia is a common symptom of many mental and physical disorders, and should be classified here in addition to the basic disorder only if it dominates the clinical picture.</div>\n');
INSERT INTO `icd10` VALUES (2598, 4, 2596, 'F51.1', 'Nonorganic hypersomnia', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Hypersomnia is defined as a condition of either excessive daytime sleepiness and sleep attacks (not accounted for by an inadequate amount of sleep) or prolonged transition to the fully aroused state upon awakening. In the absence of an organic factor for the occurrence of hypersomnia, this condition is usually associated with mental disorders.</div>\n');
INSERT INTO `icd10` VALUES (2599, 4, 2596, 'F51.2', 'Nonorganic disorder of the sleep-wake schedule', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A lack of synchrony between the sleep-wake schedule and the desired sleep-wake schedule for the individual\'s environment, resulting in a complaint of either insomnia or hypersomnia.</div>\n');
INSERT INTO `icd10` VALUES (2600, 4, 2596, 'F51.3', 'Sleepwalking [somnambulism]', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A state of altered consciousness in which phenomena of sleep and wakefulness are combined. During a sleepwalking episode the individual arises from bed, usually during the first third of nocturnal sleep, and walks about, exhibiting low levels of awareness, reactivity, and motor skill. Upon awakening, there is usually no recall of the event.</div>\n');
INSERT INTO `icd10` VALUES (2601, 4, 2596, 'F51.4', 'Sleep terrors [night terrors]', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Nocturnal episodes of extreme terror and panic associated with intense vocalization, motility, and high levels of autonomic discharge. The individual sits up or gets up, usually during the first third of nocturnal sleep, with a panicky scream. Quite often he or she rushes to the door as if trying to escape, although very seldom leaves the room. Recall of the event, if any, is very limited (usually to one or two fragmentary mental images).</div>\n');
INSERT INTO `icd10` VALUES (2602, 4, 2596, 'F51.5', 'Nightmares', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Dream experiences loaded with anxiety or fear. There is very detailed recall of the dream content. The dream experience is very vivid and usually includes themes involving threats to survival, security, or self-esteem. Quite often there is a recurrence of the same or similar frightening nightmare themes. During a typical episode there is a degree of autonomic discharge but no appreciable vocalization or body motility. Upon awakening the individual rapidly becomes alert and oriented.</div>\n');
INSERT INTO `icd10` VALUES (2603, 4, 2596, 'F51.8', 'Other nonorganic sleep disorders', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2604, 4, 2596, 'F51.9', 'Nonorganic sleep disorder, unspecified', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2605, 3, 2586, 'F52', 'Sexual dysfunction, not caused by organic disorder or disease', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Sexual dysfunction covers the various ways in which an individual is unable to participate in a sexual relationship as he or she would wish. Sexual response is a psychosomatic process and both psychological and somatic processes are usually involved in the causation of sexual dysfunction.</div>\n');
INSERT INTO `icd10` VALUES (2606, 4, 2605, 'F52.0', 'Lack or loss of sexual desire', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Loss of sexual desire is the principal problem and is not secondary to other sexual difficulties, such as erectile failure or dyspareunia.</div>\n');
INSERT INTO `icd10` VALUES (2607, 4, 2605, 'F52.1', 'Sexual aversion and lack of sexual enjoyment', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Either the prospect of sexual interaction produces sufficient fear or anxiety that sexual activity is avoided (sexual aversion) or sexual responses occur normally and orgasm is experienced but there is a lack of appropriate pleasure (lack of sexual enjoyment).</div>\n');
INSERT INTO `icd10` VALUES (2608, 4, 2605, 'F52.2', 'Failure of genital response', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>The principal problem in men is erectile dysfunction (difficulty in developing or maintaining an erection suitable for satisfactory intercourse). In women, the principal problem is vaginal dryness or failure of lubrication.</div>\n');
INSERT INTO `icd10` VALUES (2609, 4, 2605, 'F52.3', 'Orgasmic dysfunction', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Orgasm either does not occur or is markedly delayed.</div>\n');
INSERT INTO `icd10` VALUES (2610, 4, 2605, 'F52.4', 'Premature ejaculation', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>The inability to control ejaculation sufficiently for both partners to enjoy sexual interaction.</div>\n');
INSERT INTO `icd10` VALUES (2611, 4, 2605, 'F52.5', 'Nonorganic vaginismus', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Spasm of the pelvic floor muscles that surround the vagina, causing occlusion of the vaginal opening. Penile entry is either impossible or painful.</div>\n');
INSERT INTO `icd10` VALUES (2612, 4, 2605, 'F52.6', 'Nonorganic dyspareunia', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Dyspareunia (or pain during sexual intercourse) occurs in both women and men. It can often be attributed to local pathology and should then properly be categorized under the pathological condition. This category is to be used only if there is no primary nonorganic sexual dysfunction (e.g. vaginismus or vaginal dryness).</div>\n');
INSERT INTO `icd10` VALUES (2613, 4, 2605, 'F52.7', 'Excessive sexual drive', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2614, 4, 2605, 'F52.8', 'Other sexual dysfunction, not caused by organic disorder or disease', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2615, 4, 2605, 'F52.9', 'Unspecified sexual dysfunction, not caused by organic disorder or disease', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2616, 3, 2586, 'F53', 'Mental and behavioural disorders associated with the puerperium, not elsewhere classified', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>This category includes only mental disorders associated with the puerperium (commencing within six weeks of delivery) that do not meet the criteria for disorders classified elsewhere in this chapter, either because insufficient information is available, or because it is considered that special additional clinical features are present that make their classification elsewhere inappropriate.</div>\n');
INSERT INTO `icd10` VALUES (2617, 4, 2616, 'F53.0', 'Mild mental and behavioural disorders associated with the puerperium, not elsewhere classified', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2618, 4, 2616, 'F53.1', 'Severe mental and behavioural disorders associated with the puerperium, not elsewhere classified', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2619, 4, 2616, 'F53.8', 'Other mental and behavioural disorders associated with the puerperium, not elsewhere classified', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2620, 4, 2616, 'F53.9', 'Puerperal mental disorder, unspecified', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2621, 3, 2586, 'F54', 'Psychological and behavioural factors associated with disorders or diseases classified elsewhere', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>This category should be used to record the presence of psychological or behavioural influences thought to have played a major part in the etiology of physical disorders which can be classified to other chapters. Any resulting mental disturbances are usually mild, and often prolonged (such as worry, emotional conflict, apprehension) and do not of themselves justify the use of any of the categories in this chapter.</div>\n');
INSERT INTO `icd10` VALUES (2622, 3, 2586, 'F55', 'Abuse of non-dependence-producing substances', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>\n				<p>A wide variety of medicaments and folk remedies may be involved, but the particularly important groups are: (a) psychotropic drugs that do not produce dependence, such as antidepressants, (b) laxatives, and (c) analgesics that may be purchased without medical prescription, such as aspirin and paracetamol.</p>\n				<p>Persistent use of these substances often involves unnecessary contacts with medical professionals or supporting staff, and is sometimes accompanied by harmful physical effects of the substances. Attempts to dissuade or forbid the use of the substance are often met with resistance; for laxatives and analgesics this may be in spite of warnings about (or even the development of) physical harm such as renal dysfunction or electrolyte disturbances. Although it is usually clear that the patient has a strong motivation to take the substance, dependence or withdrawal symptoms do not develop as in the case of the psychoactive substances specified in F10-F19.</p>\n			</div>\n');
INSERT INTO `icd10` VALUES (2623, 3, 2586, 'F59', 'Unspecified behavioural syndromes associated with physiological disturbances and physical factors', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2624, 2, 2404, 'F60-F69', 'Disorders of adult personality and behaviour', NULL, NULL, NULL, NULL, NULL, NULL, '<div>This block includes a variety of conditions and behaviour patterns of clinical significance which tend to be persistent and appear to be the expression of the individual\'s characteristic lifestyle and mode of relating to himself or herself and others. Some of these conditions and patterns of behaviour emerge early in the course of individual development, as a result of both constitutional factors and social experience, while others are acquired later in life. Specific personality disorders (F60.-), mixed and other personality disorders (F61.-), and enduring personality changes (F62.-) are deeply ingrained and enduring behaviour patterns, manifesting as inflexible responses to a broad range of personal and social situations. They represent extreme or significant deviations from the way in which the average individual in a given culture perceives, thinks, feels and, particularly, relates to others. Such behaviour patterns tend to be stable and to encompass multiple domains of behaviour and psychological functioning. They are frequently, but not always, associated with various degrees of subjective distress and problems of social performance.</div>\n');
INSERT INTO `icd10` VALUES (2625, 3, 2624, 'F60', 'Specific personality disorders', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>These are severe disturbances in the personality and behavioural tendencies of the individual; not directly resulting from disease, damage, or other insult to the brain, or from another psychiatric disorder; usually involving several areas of the personality; nearly always associated with considerable personal distress and social disruption; and usually manifest since childhood or adolescence and continuing throughout adulthood.</div>\n');
INSERT INTO `icd10` VALUES (2626, 4, 2625, 'F60.0', 'Paranoid personality disorder', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Personality disorder characterized by excessive sensitivity to setbacks, unforgiveness of insults; suspiciousness and a tendency to distort experience by misconstruing the neutral or friendly actions of others as hostile or contemptuous; recurrent suspicions, without justification, regarding the sexual fidelity of the spouse or sexual partner; and a combative and tenacious sense of personal rights. There may be excessive self-importance, and there is often excessive self-reference.</div>\n');
INSERT INTO `icd10` VALUES (2627, 4, 2625, 'F60.1', 'Schizoid personality disorder', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Personality disorder characterized by withdrawal from affectional, social and other contacts with preference for fantasy, solitary activities, and introspection. There is a limited capacity to express feelings and to experience pleasure.</div>\n');
INSERT INTO `icd10` VALUES (2628, 4, 2625, 'F60.2', 'Dissocial personality disorder', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Personality disorder characterized by disregard for social obligations, and callous unconcern for the feelings of others. There is gross disparity between behaviour and the prevailing social norms. Behaviour is not readily modifiable by adverse experience, including punishment. There is a low tolerance to frustration and a low threshold for discharge of aggression, including violence; there is a tendency to blame others, or to offer plausible rationalizations for the behaviour bringing the patient into conflict with society.</div>\n');
INSERT INTO `icd10` VALUES (2629, 4, 2625, 'F60.3', 'Emotionally unstable personality disorder', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Personality disorder characterized by a definite tendency to act impulsively and without consideration of the consequences; the mood is unpredictable and capricious. There is a liability to outbursts of emotion and an incapacity to control the behavioural explosions. There is a tendency to quarrelsome behaviour and to conflicts with others, especially when impulsive acts are thwarted or censored. Two types may be distinguished: the impulsive type, characterized predominantly by emotional instability and lack of impulse control, and the borderline type, characterized in addition by disturbances in self-image, aims, and internal preferences, by chronic feelings of emptiness, by intense and unstable interpersonal relationships, and by a tendency to self-destructive behaviour, including suicide gestures and attempts.</div>\n');
INSERT INTO `icd10` VALUES (2630, 4, 2625, 'F60.4', 'Histrionic personality disorder', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Personality disorder characterized by shallow and labile affectivity, self-dramatization, theatricality, exaggerated expression of emotions, suggestibility, egocentricity, self-indulgence, lack of consideration for others, easily hurt feelings, and continuous seeking for appreciation, excitement and attention.</div>\n');
INSERT INTO `icd10` VALUES (2631, 4, 2625, 'F60.5', 'Anankastic personality disorder', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Personality disorder characterized by feelings of doubt, perfectionism, excessive conscientiousness, checking and preoccupation with details, stubbornness, caution, and rigidity. There may be insistent and unwelcome thoughts or impulses that do not attain the severity of an obsessive-compulsive disorder.</div>\n');
INSERT INTO `icd10` VALUES (2632, 4, 2625, 'F60.6', 'Anxious [avoidant] personality disorder', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Personality disorder characterized by feelings of tension and apprehension, insecurity and inferiority. There is a continuous yearning to be liked and accepted, a hypersensitivity to rejection and criticism with restricted personal attachments, and a tendency to avoid certain activities by habitual exaggeration of the potential dangers or risks in everyday situations.</div>\n');
INSERT INTO `icd10` VALUES (2633, 4, 2625, 'F60.7', 'Dependent personality disorder', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Personality disorder characterized by pervasive passive reliance on other people to make one\'s major and minor life decisions, great fear of abandonment, feelings of helplessness and incompetence, passive compliance with the wishes of elders and others, and a weak response to the demands of daily life. Lack of vigour may show itself in the intellectual or emotional spheres; there is often a tendency to transfer responsibility to others.</div>\n');
INSERT INTO `icd10` VALUES (2634, 4, 2625, 'F60.8', 'Other specific personality disorders', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2635, 4, 2625, 'F60.9', 'Personality disorder, unspecified', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2636, 3, 2624, 'F61', 'Mixed and other personality disorders', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>\n				<p>This category is intended for personality disorders that are often troublesome but do not demonstrate the specific pattern of symptoms that characterize the disorders described in F60.-. As a result they are often more difficult to diagnose than the disorders in F60.-.</p>\n				<p>Examples include:</p>\n				<ul class="bullet">\n					<li>\n						<p>mixed personality disorders with features of several of the disorders in F60.- but without a predominant set of symptoms that would allow a more specific diagnosis</p>\n					</li>\n					<li>\n						<p>troublesome personality changes, not classifiable to F60.- or F62.-, and regarded as secondary to a main diagnosis of a coexisting affective or anxiety disorder.</p>\n					</li>\n				</ul>\n			</div>\n');
INSERT INTO `icd10` VALUES (2637, 3, 2624, 'F62', 'Enduring personality changes, not attributable to brain damage and disease', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Disorders of adult personality and behaviour that have developed in persons with no previous personality disorder following exposure to catastrophic or excessive prolonged stress, or following a severe psychiatric illness. These diagnoses should be made only when there is evidence of a definite and enduring change in a person\'s pattern of perceiving, relating to, or thinking about the environment and himself or herself. The personality change should be significant and be associated with inflexible and maladaptive behaviour not present before the pathogenic experience. The change should not be a direct manifestation of another mental disorder or a residual symptom of any antecedent mental disorder.</div>\n');
INSERT INTO `icd10` VALUES (2638, 4, 2637, 'F62.0', 'Enduring personality change after catastrophic experience', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Enduring personality change, present for at least two years, following exposure to catastrophic stress. The stress must be so extreme that it is not necessary to consider personal vulnerability in order to explain its profound effect on the personality. The disorder is characterized by a hostile or distrustful attitude toward the world, social withdrawal, feelings of emptiness or hopelessness, a chronic feeling of "being on edge" as if constantly threatened, and estrangement. Post-traumatic stress disorder (F43.1) may precede this type of personality change.</div>\n');
INSERT INTO `icd10` VALUES (2639, 4, 2637, 'F62.1', 'Enduring personality change after psychiatric illness', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Personality change, persisting for at least two years, attributable to the traumatic experience of suffering from a severe psychiatric illness. The change cannot be explained by a previous personality disorder and should be differentiated from residual schizophrenia and other states of incomplete recovery from an antecedent mental disorder. This disorder is characterized by an excessive dependence on and a demanding attitude towards others; conviction of being changed or stigmatized by the illness, leading to an inability to form and maintain close and confiding personal relationships and to social iso-lation; passivity, reduced interests, and diminished involvement in leisure activities; persistent complaints of being ill, which may be associated with hypochondriacal claims and illness behaviour; dysphoric or labile mood, not due to the presence of a current mental disorder or antecedent mental disorder with residual affective symptoms; and longstanding problems in social and occupational functioning.</div>\n');
INSERT INTO `icd10` VALUES (2640, 4, 2637, 'F62.8', 'Other enduring personality changes', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2641, 4, 2637, 'F62.9', 'Enduring personality change, unspecified', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2642, 3, 2624, 'F63', 'Habit and impulse disorders', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>This category includes certain disorders of behaviour that are not classifiable under other categories. They are characterized by repeated acts that have no clear rational motivation, cannot be controlled, and generally harm the patient\'s own interests and those of other people. The patient reports that the behaviour is associated with impulses to action. The cause of these disorders is not understood and they are grouped together because of broad descriptive similarities, not because they are known to share any other important features.</div>\n');
INSERT INTO `icd10` VALUES (2643, 4, 2642, 'F63.0', 'Pathological gambling', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>The disorder consists of frequent, repeated episodes of gambling that dominate the patient\'s life to the detriment of social, occupational, material, and family values and commitments.</div>\n');
INSERT INTO `icd10` VALUES (2644, 4, 2642, 'F63.1', 'Pathological fire-setting [pyromania]', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Disorder characterized by multiple acts of, or attempts at, setting fire to property or other objects, without apparent motive, and by a persistent preoccupation with subjects related to fire and burning. This behaviour is often associated with feelings of increasing tension before the act, and intense excitement immediately afterwards.</div>\n');
INSERT INTO `icd10` VALUES (2645, 4, 2642, 'F63.2', 'Pathological stealing [kleptomania]', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Disorder characterized by repeated failure to resist impulses to steal objects that are not acquired for personal use or monetary gain. The objects may instead be discarded, given away, or hoarded. This behaviour is usually accompanied by an increasing sense of tension before, and a sense of gratification during and immediately after, the act.</div>\n');
INSERT INTO `icd10` VALUES (2646, 4, 2642, 'F63.3', 'Trichotillomania', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A disorder characterized by noticeable hair-loss due to a recurrent failure to resist impulses to pull out hairs. The hair-pulling is usually preceded by mounting tension and is followed by a sense of relief or gratification. This diagnosis should not be made if there is a pre-existing inflammation of the skin, or if the hair-pulling is in response to a delusion or a hallucination.</div>\n');
INSERT INTO `icd10` VALUES (2647, 4, 2642, 'F63.8', 'Other habit and impulse disorders', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Other kinds of persistently repeated maladaptive behaviour that are not secondary to a recognized psychiatric syndrome, and in which it appears that the patient is repeatedly failing to resist impulses to carry out the behaviour. There is a prodromal period of tension with a feeling of release at the time of the act.</div>\n');
INSERT INTO `icd10` VALUES (2648, 4, 2642, 'F63.9', 'Habit and impulse disorder, unspecified', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2649, 3, 2624, 'F64', 'Gender identity disorders', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2650, 4, 2649, 'F64.0', 'Transsexualism', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A desire to live and be accepted as a member of the opposite sex, usually accompanied by a sense of discomfort with, or inappropriateness of, one\'s anatomic sex, and a wish to have surgery and hormonal treatment to make one\'s body as congruent as possible with one\'s preferred sex.</div>\n');
INSERT INTO `icd10` VALUES (2651, 4, 2649, 'F64.1', 'Dual-role transvestism', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>The wearing of clothes of the opposite sex for part of the individual\'s existence in order to enjoy the temporary experience of membership of the opposite sex, but without any desire for a more permanent sex change or associated surgical reassignment, and without sexual excitement accompanying the cross-dressing.</div>\n');
INSERT INTO `icd10` VALUES (2652, 4, 2649, 'F64.2', 'Gender identity disorder of childhood', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A disorder, usually first manifest during early childhood (and always well before puberty), characterized by a persistent and intense distress about assigned sex, together with a desire to be (or insistence that one is) of the other sex. There is a persistent preoccupation with the dress and activities of the opposite sex and repudiation of the individual\'s own sex. The diagnosis requires a profound disturbance of the normal gender identity; mere tomboyishness in girls or girlish behaviour in boys is not sufficient. Gender identity disorders in individuals who have reached or are entering puberty should not be classified here but in F66.-.</div>\n');
INSERT INTO `icd10` VALUES (2653, 4, 2649, 'F64.8', 'Other gender identity disorders', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2654, 4, 2649, 'F64.9', 'Gender identity disorder, unspecified', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2655, 3, 2624, 'F65', 'Disorders of sexual preference', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2656, 4, 2655, 'F65.0', 'Fetishism', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Reliance on some non-living object as a stimulus for sexual arousal and sexual gratification. Many fetishes are extensions of the human body, such as articles of clothing or footwear. Other common examples are characterized by some particular texture such as rubber, plastic or leather. Fetish objects vary in their importance to the individual. In some cases they simply serve to enhance sexual excitement achieved in ordinary ways (e.g. having the partner wear a particular garment).</div>\n');
INSERT INTO `icd10` VALUES (2657, 4, 2655, 'F65.1', 'Fetishistic transvestism', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>The wearing of clothes of the opposite sex principally to obtain sexual excitement and to create the appearance of a person of the opposite sex. Fetishistic transvestism is distinguished from transsexual transvestism by its clear association with sexual arousal and the strong desire to remove the clothing once orgasm occurs and sexual arousal declines. It can occur as an earlier phase in the development of transsexualism.</div>\n');
INSERT INTO `icd10` VALUES (2658, 4, 2655, 'F65.2', 'Exhibitionism', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A recurrent or persistent tendency to expose the genitalia to strangers (usually of the opposite sex) or to people in public places, without inviting or intending closer contact. There is usually, but not invariably, sexual excitement at the time of the exposure and the act is commonly followed by masturbation.</div>\n');
INSERT INTO `icd10` VALUES (2659, 4, 2655, 'F65.3', 'Voyeurism', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A recurrent or persistent tendency to look at people engaging in sexual or intimate behaviour such as undressing. This is carried out without the observed people being aware, and usually leads to sexual excitement and masturbation.</div>\n');
INSERT INTO `icd10` VALUES (2660, 4, 2655, 'F65.4', 'Paedophilia', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A sexual preference for children, boys or girls or both, usually of prepubertal or early pubertal age.</div>\n');
INSERT INTO `icd10` VALUES (2661, 4, 2655, 'F65.5', 'Sadomasochism', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A preference for sexual activity which involves the infliction of pain or humiliation, or bondage. If the subject prefers to be the recipient of such stimulation this is called masochism; if the provider, sadism. Often an individual obtains sexual excitement from both sadistic and masochistic activities.</div>\n');
INSERT INTO `icd10` VALUES (2662, 4, 2655, 'F65.6', 'Multiple disorders of sexual preference', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Sometimes more than one abnormal sexual preference occurs in one person and there is none of first rank. The most common combination is fetishism, transvestism and sadomasochism.</div>\n');
INSERT INTO `icd10` VALUES (2663, 4, 2655, 'F65.8', 'Other disorders of sexual preference', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A variety of other patterns of sexual preference and activity, including making obscene telephone calls, rubbing up against people for sexual stimulation in crowded public places, sexual activity with animals, and use of strangulation or anoxia for intensifying sexual excitement.</div>\n');
INSERT INTO `icd10` VALUES (2664, 4, 2655, 'F65.9', 'Disorder of sexual preference, unspecified', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2665, 3, 2624, 'F66', 'Psychological and behavioural disorders associated with sexual development and orientation', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Sexual orientation by itself is not to be regarded as a disorder.</div>\n');
INSERT INTO `icd10` VALUES (2666, 4, 2665, 'F66.0', 'Sexual maturation disorder', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>The patient suffers from uncertainty about his or her gender identity or sexual orientation, which causes anxiety or depression. Most commonly this occurs in adolescents who are not certain whether they are homosexual, heterosexual or bisexual in orientation, or in individuals who, after a period of apparently stable sexual orientation (often within a longstanding relationship), find that their sexual orientation is changing.</div>\n');
INSERT INTO `icd10` VALUES (2667, 4, 2665, 'F66.1', 'Egodystonic sexual orientation', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>The gender identity or sexual preference (heterosexual, homosexual, bisexual, or prepubertal) is not in doubt, but the individual wishes it were different because of associated psychological and behavioural disorders, and may seek treatment in order to change it.</div>\n');
INSERT INTO `icd10` VALUES (2668, 4, 2665, 'F66.2', 'Sexual relationship disorder', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>The gender identity or sexual orientation (heterosexual, homosexual, or bisexual) is responsible for difficulties in forming or maintaining a relationship with a sexual partner.</div>\n');
INSERT INTO `icd10` VALUES (2669, 4, 2665, 'F66.8', 'Other psychosexual development disorders', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2670, 4, 2665, 'F66.9', 'Psychosexual development disorder, unspecified', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2671, 3, 2624, 'F68', 'Other disorders of adult personality and behaviour', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2672, 4, 2671, 'F68.0', 'Elaboration of physical symptoms for psychological reasons', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Physical symptoms compatible with and originally due to a confirmed physical disorder, disease or disability become exaggerated or prolonged due to the psychological state of the patient. The patient is commonly distressed by this pain or disability, and is often preoccupied with worries, which may be justified, of the possibility of prolonged or progressive disability or pain.</div>\n');
INSERT INTO `icd10` VALUES (2673, 4, 2671, 'F68.1', 'Intentional production or feigning of symptoms or disabilities, either physical or psychological [factitious disorder]', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>The patient feigns symptoms repeatedly for no obvious reason and may even inflict self-harm in order to produce symptoms or signs. The motivation is obscure and presumably internal with the aim of adopting the sick role. The disorder is often combined with marked disorders of personality and relationships.</div>\n');
INSERT INTO `icd10` VALUES (2674, 4, 2671, 'F68.8', 'Other specified disorders of adult personality and behaviour', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2675, 3, 2624, 'F69', 'Unspecified disorder of adult personality and behaviour', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2676, 2, 2404, 'F70-F79', 'Mental retardation', NULL, NULL, NULL, NULL, NULL, NULL, '<div>\n				<p>A condition of arrested or incomplete development of the mind, which is especially characterized by impairment of skills manifested during the developmental period, skills which contribute to the overall level of intelligence, i.e. cognitive, language, motor, and social abilities. Retardation can occur with or without any other mental or physical condition.</p>\n				<p>Degrees of mental retardation are conventionally estimated by standardized intelligence tests. These can be supplemented by scales assessing social adaptation in a given environment. These measures provide an approximate indication of the degree of mental retardation. The diagnosis will also depend on the overall assessment of intellectual functioning by a skilled diagnostician.</p>\n				<p>Intellectual abilities and social adaptation may change over time, and, however poor, may improve as a result of training and rehabilitation. Diagnosis should be based on the current levels of functioning.</p>\n			</div>\n');
INSERT INTO `icd10` VALUES (2677, 3, 2676, 'F70', 'Mild mental retardation', NULL, '118', '1-057', '2-072', '3-059', '4-044', '<div>[See before F70 for subdivisions]</div>\n<div>Approximate IQ range of 50 to 69 (in adults, mental age from 9 to under 12 years). Likely to result in some learning difficulties in school. Many adults will be able to work and maintain good social relationships and contribute to society.</div>\n');
INSERT INTO `icd10` VALUES (2678, 3, 2676, 'F71', 'Moderate mental retardation', NULL, '118', '1-057', '2-072', '3-059', '4-044', '<div>[See before F70 for subdivisions]</div>\n<div>Approximate IQ range of 35 to 49 (in adults, mental age from 6 to under 9 years). Likely to result in marked developmental delays in childhood but most can learn to develop some degree of independence in self-care and acquire adequate communication and academic skills. Adults will need varying degrees of support to live and work in the community.</div>\n');
INSERT INTO `icd10` VALUES (2679, 3, 2676, 'F72', 'Severe mental retardation', NULL, '118', '1-057', '2-072', '3-059', '4-044', '<div>[See before F70 for subdivisions]</div>\n<div>Approximate IQ range of 20 to 34 (in adults, mental age from 3 to under 6 years). Likely to result in continuous need of support.</div>\n');
INSERT INTO `icd10` VALUES (2680, 3, 2676, 'F73', 'Profound mental retardation', NULL, '118', '1-057', '2-072', '3-059', '4-044', '<div>[See before F70 for subdivisions]</div>\n<div>IQ under 20 (in adults, mental age below 3 years). Results in severe limitation in self-care, continence, communication and mobility.</div>\n');
INSERT INTO `icd10` VALUES (2681, 3, 2676, 'F78', 'Other mental retardation', NULL, '118', '1-057', '2-072', '3-059', '4-044', '<div>[See before F70 for subdivisions]</div>\n');
INSERT INTO `icd10` VALUES (2682, 3, 2676, 'F79', 'Unspecified mental retardation', NULL, '118', '1-057', '2-072', '3-059', '4-044', '<div>[See before F70 for subdivisions]</div>\n');
INSERT INTO `icd10` VALUES (2683, 2, 2404, 'F80-F89', 'Disorders of psychological development', NULL, NULL, NULL, NULL, NULL, NULL, '<div>The disorders included in this block have in common: (a) onset invariably during infancy or childhood; (b) impairment or delay in development of functions that are strongly related to biological maturation of the central nervous system; and (c) a steady course without remissions and relapses. In most cases, the functions affected include language, visuo-spatial skills, and motor coordination. Usually, the delay or impairment has been present from as early as it could be detected reliably and will diminish progressively as the child grows older, although milder deficits often remain in adult life.</div>\n');
INSERT INTO `icd10` VALUES (2684, 3, 2683, 'F80', 'Specific developmental disorders of speech and language', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Disorders in which normal patterns of language acquisition are disturbed from the early stages of development. The conditions are not directly attributable to neurological or speech mechanism abnormalities, sensory impairments, mental retardation, or environmental factors. Specific developmental disorders of speech and language are often followed by associated problems, such as difficulties in reading and spelling, abnormalities in interpersonal relationships, and emotional and behavioural disorders.</div>\n');
INSERT INTO `icd10` VALUES (2685, 4, 2684, 'F80.0', 'Specific speech articulation disorder', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A specific developmental disorder in which the child\'s use of speech sounds is below the appropriate level for its mental age, but in which there is a normal level of language skills.</div>\n');
INSERT INTO `icd10` VALUES (2686, 4, 2684, 'F80.1', 'Expressive language disorder', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A specific developmental disorder in which the child\'s ability to use expressive spoken language is markedly below the appropriate level for its mental age, but in which language comprehension is within normal limits. There may or may not be abnormalities in articulation.</div>\n');
INSERT INTO `icd10` VALUES (2687, 4, 2684, 'F80.2', 'Receptive language disorder', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A specific developmental disorder in which the child\'s understanding of language is below the appropriate level for its mental age. In virtually all cases expressive language will also be markedly affected and abnormalities in word-sound production are common.</div>\n');
INSERT INTO `icd10` VALUES (2688, 4, 2684, 'F80.3', 'Acquired aphasia with epilepsy [Landau-Kleffner]', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A disorder in which the child, having previously made normal progress in language development, loses both receptive and expressive language skills but retains general intelligence; the onset of the disorder is accompanied by paroxysmal abnormalities on the EEG, and in the majority of cases also by epileptic seizures. Usually the onset is between the ages of three and seven years, with skills being lost over days or weeks. The temporal association between the onset of seizures and loss of language is variable, with one preceding the other (either way round) by a few months to two years. An inflammatory encephalitic process has been suggested as a possible cause of this disorder. About two-thirds of patients are left with a more or less severe receptive language deficit.</div>\n');
INSERT INTO `icd10` VALUES (2689, 4, 2684, 'F80.8', 'Other developmental disorders of speech and language', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2690, 4, 2684, 'F80.9', 'Developmental disorder of speech and language, unspecified', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2691, 3, 2683, 'F81', 'Specific developmental disorders of scholastic skills', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Disorders in which the normal patterns of skill acquisition are disturbed from the early stages of development. This is not simply a consequence of a lack of opportunity to learn, it is not solely a result of mental retardation, and it is not due to any form of acquired brain trauma or disease.</div>\n');
INSERT INTO `icd10` VALUES (2692, 4, 2691, 'F81.0', 'Specific reading disorder', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>The main feature is a specific and significant impairment in the development of reading skills that is not solely accounted for by mental age, visual acuity problems, or inadequate schooling. Reading comprehension skill, reading word recognition, oral reading skill, and performance of tasks requiring reading may all be affected. Spelling difficulties are frequently associated with specific reading disorder and often remain into adolescence even after some progress in reading has been made. Specific developmental disorders of reading are commonly preceded by a history of disorders in speech or language development. Associated emotional and behavioural disturbances are common during the school age period.</div>\n');
INSERT INTO `icd10` VALUES (2693, 4, 2691, 'F81.1', 'Specific spelling disorder', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>The main feature is a specific and significant impairment in the development of spelling skills in the absence of a history of specific reading disorder, which is not solely accounted for by low mental age, visual acuity problems, or inadequate schooling. The ability to spell orally and to write out words correctly are both affected.</div>\n');
INSERT INTO `icd10` VALUES (2694, 4, 2691, 'F81.2', 'Specific disorder of arithmetical skills', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Involves a specific impairment in arithmetical skills that is not solely explicable on the basis of general mental retardation or of inadequate schooling. The deficit concerns mastery of basic computational skills of addition, subtraction, multiplication, and division rather than of the more abstract mathematical skills involved in algebra, trigonometry, geometry, or calculus.</div>\n');
INSERT INTO `icd10` VALUES (2695, 4, 2691, 'F81.3', 'Mixed disorder of scholastic skills', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>An ill-defined residual category of disorders in which both arithmetical and reading or spelling skills are significantly impaired, but in which the disorder is not solely explicable in terms of general mental retardation or of inadequate schooling. It should be used for disorders meeting the criteria for both F81.2 and either F81.0 or F81.1.</div>\n');
INSERT INTO `icd10` VALUES (2696, 4, 2691, 'F81.8', 'Other developmental disorders of scholastic skills', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2697, 4, 2691, 'F81.9', 'Developmental disorder of scholastic skills, unspecified', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2698, 3, 2683, 'F82', 'Specific developmental disorder of motor function', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A disorder in which the main feature is a serious impairment in the development of motor coordination that is not solely explicable in terms of general intellectual retardation or of any specific congenital or acquired neurological disorder. Nevertheless, in most cases a careful clinical examination shows marked neurodevelopmental immaturities such as choreiform movements of unsupported limbs or mirror movements and other associated motor features, as well as signs of impaired fine and gross motor coordination.</div>\n');
INSERT INTO `icd10` VALUES (2699, 3, 2683, 'F83', 'Mixed specific developmental disorders', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A residual category for disorders in which there is some admixture of specific developmental disorders of speech and language, of scholastic skills, and of motor function, but in which none predominates sufficiently to constitute the prime diagnosis. This mixed category should be used only when there is a major overlap between each of these specific developmental disorders. The disorders are usually, but not always, associated with some degree of general impairment of cognitive functions. Thus, the category should be used when there are dysfunctions meeting the criteria for two or more of F80.-, F81.- and F82.</div>\n');
INSERT INTO `icd10` VALUES (2700, 3, 2683, 'F84', 'Pervasive developmental disorders', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A group of disorders characterized by qualitative abnormalities in reciprocal social interactions and in patterns of communication, and by a restricted, stereotyped, repetitive repertoire of interests and activities. These qualitative abnormalities are a pervasive feature of the individual\'s functioning in all situations.</div>\n');
INSERT INTO `icd10` VALUES (2701, 4, 2700, 'F84.0', 'Childhood autism', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A type of pervasive developmental disorder that is defined by: (a) the presence of abnormal or impaired development that is manifest before the age of three years, and (b) the characteristic type of abnormal functioning in all the three areas of psychopathology: reciprocal social interaction, communication, and restricted, stereotyped, repetitive behaviour. In addition to these specific diagnostic features, a range of other nonspecific problems are common, such as phobias, sleeping and eating disturbances, temper tantrums, and (self-directed) aggression.</div>\n');
INSERT INTO `icd10` VALUES (2702, 4, 2700, 'F84.1', 'Atypical autism', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A type of pervasive developmental disorder that differs from childhood autism either in age of onset or in failing to fulfil all three sets of diagnostic criteria. This subcategory should be used when there is abnormal and impaired development that is present only after age three years, and a lack of sufficient demonstrable abnormalities in one or two of the three areas of psychopathology required for the diagnosis of autism (namely, reciprocal social interactions, communication, and restricted, stereotyped, repetitive behaviour) in spite of characteristic abnormalities in the other area(s). Atypical autism arises most often in profoundly retarded individuals and in individuals with a severe specific developmental disorder of receptive language.</div>\n');
INSERT INTO `icd10` VALUES (2703, 4, 2700, 'F84.2', 'Rett syndrome', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A condition, so far found only in girls, in which apparently normal early development is followed by partial or complete loss of speech and of skills in locomotion and use of hands, together with deceleration in head growth, usually with an onset between seven and 24 months of age. Loss of purposive hand movements, hand-wringing stereotypies, and hyperventilation are characteristic. Social and play development are arrested but social interest tends to be maintained. Trunk ataxia and apraxia start to develop by age four years and choreoathetoid movements frequently follow. Severe mental retardation almost invariably results.</div>\n');
INSERT INTO `icd10` VALUES (2704, 4, 2700, 'F84.3', 'Other childhood disintegrative disorder', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A type of pervasive developmental disorder that is defined by a period of entirely normal development before the onset of the disorder, followed by a definite loss of previously acquired skills in several areas of development over the course of a few months. Typically, this is accompanied by a general loss of interest in the environment, by stereotyped, repetitive motor mannerisms, and by autistic-like abnormalities in social interaction and communication. In some cases the disorder can be shown to be due to some associated encephalopathy but the diagnosis should be made on the behavioural features.</div>\n');
INSERT INTO `icd10` VALUES (2705, 4, 2700, 'F84.4', 'Overactive disorder associated with mental retardation and stereotyped movements', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>An ill-defined disorder of uncertain nosological validity. The category is designed to include a group of children with severe mental retardation (IQ below 35) who show major problems in hyperactivity and in attention, as well as stereotyped behaviours. They tend not to benefit from stimulant drugs (unlike those with an IQ in the normal range) and may exhibit a severe dysphoric reaction (sometimes with psychomotor retardation) when given stimulants. In adolescence, the overactivity tends to be replaced by underactivity (a pattern that is not usual in hyperkinetic children with normal intelligence). This syndrome is also often associated with a variety of developmental delays, either specific or global. The extent to which the behavioural pattern is a function of low IQ or of organic brain damage is not known.</div>\n');
INSERT INTO `icd10` VALUES (2706, 4, 2700, 'F84.5', 'Asperger syndrome', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A disorder of uncertain nosological validity, characterized by the same type of qualitative abnormalities of reciprocal social interaction that typify autism, together with a restricted, stereotyped, repetitive repertoire of interests and activities. It differs from autism primarily in the fact that there is no general delay or retardation in language or in cognitive development. This disorder is often associated with marked clumsiness. There is a strong tendency for the abnormalities to persist into adolescence and adult life. Psychotic episodes occasionally occur in early adult life.</div>\n');
INSERT INTO `icd10` VALUES (2707, 4, 2700, 'F84.8', 'Other pervasive developmental disorders', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2708, 4, 2700, 'F84.9', 'Pervasive developmental disorder, unspecified', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2709, 3, 2683, 'F88', 'Other disorders of psychological development', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2710, 3, 2683, 'F89', 'Unspecified disorder of psychological development', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2711, 2, 2404, 'F90-F98', 'Behavioural and emotional disorders with onset usually occurring in childhood and adolescence', NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `icd10` VALUES (2712, 3, 2711, 'F90', 'Hyperkinetic disorders', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A group of disorders characterized by an early onset (usually in the first five years of life), lack of persistence in activities that require cognitive involvement, and a tendency to move from one activity to another without completing any one, together with disorganized, ill-regulated, and excessive activity. Several other abnormalities may be associated. Hyperkinetic children are often reckless and impulsive, prone to accidents, and find themselves in disciplinary trouble because of unthinking breaches of rules rather than deliberate defiance. Their relationships with adults are often socially disinhibited, with a lack of normal caution and reserve. They are unpopular with other children and may become isolated. Impairment of cognitive functions is common, and specific delays in motor and language development are disproportionately frequent. Secondary complications include dissocial behaviour and low self-esteem.</div>\n');
INSERT INTO `icd10` VALUES (2713, 4, 2712, 'F90.0', 'Disturbance of activity and attention', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2714, 4, 2712, 'F90.1', 'Hyperkinetic conduct disorder', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2715, 4, 2712, 'F90.8', 'Other hyperkinetic disorders', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2716, 4, 2712, 'F90.9', 'Hyperkinetic disorder, unspecified', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2717, 3, 2711, 'F91', 'Conduct disorders', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>\n				<p>Disorders characterized by a repetitive and persistent pattern of dissocial, aggressive, or defiant conduct. Such behaviour should amount to major violations of age-appropriate social expectations; it should therefore be more severe than ordinary childish mischief or adolescent rebelliousness and should imply an enduring pattern of behaviour (six months or longer). Features of conduct disorder can also be symptomatic of other psychiatric conditions, in which case the underlying diagnosis should be preferred.</p>\n				<p>Examples of the behaviours on which the diagnosis is based include excessive levels of fighting or bullying, cruelty to other people or animals, severe destructiveness to property, fire-setting, stealing, repeated lying, truancy from school and running away from home, unusually frequent and severe temper tantrums, and disobedience. Any one of these behaviours, if marked, is sufficient for the diagnosis, but isolated dissocial acts are not.</p>\n			</div>\n');
INSERT INTO `icd10` VALUES (2718, 4, 2717, 'F91.0', 'Conduct disorder confined to the family context', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Conduct disorder involving dissocial or aggressive behaviour (and not merely oppositional, defiant, disruptive behaviour), in which the abnormal behaviour is entirely, or almost entirely, confined to the home and to interactions with members of the nuclear family or immediate household. The disorder requires that the overall criteria for F91.- be met; even severely disturbed parent-child relationships are not of themselves sufficient for diagnosis.</div>\n');
INSERT INTO `icd10` VALUES (2719, 4, 2717, 'F91.1', 'Unsocialized conduct disorder', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Disorder characterized by the combination of persistent dissocial or aggressive behaviour (meeting the overall criteria for F91.- and not merely comprising oppositional, defiant, disruptive behaviour) with significant pervasive abnormalities in the individual\'s relationships with other children.</div>\n');
INSERT INTO `icd10` VALUES (2720, 4, 2717, 'F91.2', 'Socialized conduct disorder', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Disorder involving persistent dissocial or aggressive behaviour (meeting the overall criteria for F91.- and not merely comprising oppositional, defiant, disruptive behaviour) occurring in individuals who are generally well integrated into their peer group.</div>\n');
INSERT INTO `icd10` VALUES (2721, 4, 2717, 'F91.3', 'Oppositional defiant disorder', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Conduct disorder, usually occurring in younger children, primarily characterized by markedly defiant, disobedient, disruptive behaviour that does not include delinquent acts or the more extreme forms of aggressive or dissocial behaviour. The disorder requires that the overall criteria for F91.- be met; even severely mischievous or naughty behaviour is not in itself sufficient for diagnosis. Caution should be employed before using this category, especially with older children, because clinically significant conduct disorder will usually be accompanied by dissocial or aggressive behaviour that goes beyond mere defiance, disobedience, or disruptiveness.</div>\n');
INSERT INTO `icd10` VALUES (2722, 4, 2717, 'F91.8', 'Other conduct disorders', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2723, 4, 2717, 'F91.9', 'Conduct disorder, unspecified', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2724, 3, 2711, 'F92', 'Mixed disorders of conduct and emotions', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A group of disorders characterized by the combination of persistently aggressive, dissocial or defiant behaviour with overt and marked symptoms of depression, anxiety or other emotional upsets. The criteria for both conduct disorders of childhood (F9l.-) and emotional disorders of childhood (F93.-) or an adult-type neurotic diagnosis (F40-F48) or a mood disorder (F30-F39) must be met.</div>\n');
INSERT INTO `icd10` VALUES (2725, 4, 2724, 'F92.0', 'Depressive conduct disorder', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>This category requires the combination of conduct disorder (F91.-) with persistent and marked depression of mood (F32.-), as demonstrated by symptoms such as excessive misery, loss of interest and pleasure in usual activities, self-blame, and hopelessness; disturbances of sleep or appetite may also be present.</div>\n');
INSERT INTO `icd10` VALUES (2726, 4, 2724, 'F92.8', 'Other mixed disorders of conduct and emotions', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>This category requires the combination of conduct disorder (F91.-) with persistent and marked emotional symptoms such as anxiety, obsessions or compulsions, depersonalization or derealization, phobias, or hypochondriasis.</div>\n');
INSERT INTO `icd10` VALUES (2727, 4, 2724, 'F92.9', 'Mixed disorder of conduct and emotions, unspecified', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2728, 3, 2711, 'F93', 'Emotional disorders with onset specific to childhood', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Mainly exaggerations of normal developmental trends rather than phenomena that are qualitatively abnormal in themselves. Developmental appropriateness is used as the key diagnostic feature in defining the difference between these emotional disorders, with onset specific to childhood, and the neurotic disorders (F40-F48).</div>\n');
INSERT INTO `icd10` VALUES (2729, 4, 2728, 'F93.0', 'Separation anxiety disorder of childhood', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Should be diagnosed when fear of separation constitutes the focus of the anxiety and when such anxiety first arose during the early years of childhood. It is differentiated from normal separation anxiety when it is of a degree (severity) that is statistically unusual (including an abnormal persistence beyond the usual age period), and when it is associated with significant problems in social functioning.</div>\n');
INSERT INTO `icd10` VALUES (2730, 4, 2728, 'F93.1', 'Phobic anxiety disorder of childhood', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Fears in childhood that show a marked developmental phase specificity and arise (to some extent) in a majority of children, but that are abnormal in degree. Other fears that arise in childhood but that are not a normal part of psychosocial development (for example agoraphobia) should be coded under the appropriate category in section F40-F48.</div>\n');
INSERT INTO `icd10` VALUES (2731, 4, 2728, 'F93.2', 'Social anxiety disorder of childhood', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>In this disorder there is a wariness of strangers and social apprehension or anxiety when encountering new, strange, or socially threatening situations. This category should be used only where such fears arise during the early years, and are both unusual in degree and accompanied by problems in social functioning.</div>\n');
INSERT INTO `icd10` VALUES (2732, 4, 2728, 'F93.3', 'Sibling rivalry disorder', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Some degree of emotional disturbance usually following the birth of an immediately younger sibling is shown by a majority of young children. A sibling rivalry disorder should be diagnosed only if the degree or persistence of the disturbance is both statistically unusual and associated with abnormalities of social interaction.</div>\n');
INSERT INTO `icd10` VALUES (2733, 4, 2728, 'F93.8', 'Other childhood emotional disorders', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2734, 4, 2728, 'F93.9', 'Childhood emotional disorder, unspecified', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2735, 3, 2711, 'F94', 'Disorders of social functioning with onset specific to childhood and adolescence', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A somewhat heterogeneous group of disorders that have in common abnormalities in social functioning which begin during the developmental period, but which (unlike the pervasive developmental disorders) are not primarily characterized by an apparently constitutional social incapacity or deficit that pervades all areas of functioning. In many instances, serious environmental distortions or privations probably play a crucial role in etiology.</div>\n');
INSERT INTO `icd10` VALUES (2736, 4, 2735, 'F94.0', 'Elective mutism', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Characterized by a marked, emotionally determined selectivity in speaking, such that the child demonstrates a language competence in some situations but fails to speak in other (definable) situations. The disorder is usually associated with marked personality features involving social anxiety, withdrawal, sensitivity, or resistance.</div>\n');
INSERT INTO `icd10` VALUES (2737, 4, 2735, 'F94.1', 'Reactive attachment disorder of childhood', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Starts in the first five years of life and is characterized by persistent abnormalities in the child\'s pattern of social relationships that are associated with emotional disturbance and are reactive to changes in environmental circumstances (e.g. fearfulness and hypervigilance, poor social interaction with peers, aggression towards self and others, misery, and growth failure in some cases). The syndrome probably occurs as a direct result of severe parental neglect, abuse, or serious mishandling.</div>\n');
INSERT INTO `icd10` VALUES (2738, 4, 2735, 'F94.2', 'Disinhibited attachment disorder of childhood', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A particular pattern of abnormal social functioning that arises during the first five years of life and that tends to persist despite marked changes in environmental circumstances, e.g. diffuse, nonselectively focused attachment behaviour, attention-seeking and indiscriminately friendly behaviour, poorly modulated peer interactions; depending on circumstances there may also be associated emotional or behavioural disturbance.</div>\n');
INSERT INTO `icd10` VALUES (2739, 4, 2735, 'F94.8', 'Other childhood disorders of social functioning', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2740, 4, 2735, 'F94.9', 'Childhood disorder of social functioning, unspecified', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2741, 3, 2711, 'F95', 'Tic disorders', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Syndromes in which the predominant manifestation is some form of tic. A tic is an involuntary, rapid, recurrent, nonrhythmic motor movement (usually involving circumscribed muscle groups) or vocal production that is of sudden onset and that serves no apparent purpose. Tics tend to be experienced as irresistible but usually they can be suppressed for varying periods of time, are exacerbated by stress, and disappear during sleep. Common simple motor tics include only eye-blinking, neck-jerking, shoulder- shrugging, and facial grimacing. Common simple vocal tics include throat-clearing, barking, sniffing, and hissing. Common complex tics include hitting oneself, jumping, and hopping. Common complex vocal tics include the repetition of particular words, and sometimes the use of socially unacceptable (often obscene) words (coprolalia), and the repetition of one\'s own sounds or words (palilalia).</div>\n');
INSERT INTO `icd10` VALUES (2742, 4, 2741, 'F95.0', 'Transient tic disorder', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Meets the general criteria for a tic disorder but the tics do not persist longer than 12 months. The tics usually take the form of eye-blinking, facial grimacing, or head-jerking.</div>\n');
INSERT INTO `icd10` VALUES (2743, 4, 2741, 'F95.1', 'Chronic motor or vocal tic disorder', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Meets the general criteria for a tic disorder, in which there are motor or vocal tics (but not both), that may be either single or multiple (but usually multiple), and last for more than a year.</div>\n');
INSERT INTO `icd10` VALUES (2744, 4, 2741, 'F95.2', 'Combined vocal and multiple motor tic disorder [de la Tourette]', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A form of tic disorder in which there are, or have been, multiple motor tics and one or more vocal tics, although these need not have occurred concurrently. The disorder usually worsens during adolescence and tends to persist into adult life. The vocal tics are often multiple with explosive repetitive vocalizations, throat-clearing, and grunting, and there may be the use of obscene words or phrases. Sometimes there is associated gestural echopraxia which may also be of an obscene nature (copropraxia).</div>\n');
INSERT INTO `icd10` VALUES (2745, 4, 2741, 'F95.8', 'Other tic disorders', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2746, 4, 2741, 'F95.9', 'Tic disorder, unspecified', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2747, 3, 2711, 'F98', 'Other behavioural and emotional disorders with onset usually occurring in childhood and adolescence', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A heterogeneous group of disorders that share the characteristic of an onset in childhood but otherwise differ in many respects. Some of the conditions represent well-defined syndromes but others are no more than symptom complexes that need inclusion because of their frequency and association with psychosocial problems, and because they cannot be incorporated into other syndromes.</div>\n');
INSERT INTO `icd10` VALUES (2748, 4, 2747, 'F98.0', 'Nonorganic enuresis', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A disorder characterized by involuntary voiding of urine, by day and by night, which is abnormal in relation to the individual\'s mental age, and which is not a consequence of a lack of bladder control due to any neurological disorder, to epileptic attacks, or to any structural abnormality of the urinary tract. The enuresis may have been present from birth or it may have arisen following a period of acquired bladder control. The enuresis may or may not be associated with a more widespread emotional or behavioural disorder.</div>\n');
INSERT INTO `icd10` VALUES (2749, 4, 2747, 'F98.1', 'Nonorganic encopresis', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Repeated, voluntary or involuntary passage of faeces, usually of normal or near-normal consistency, in places not appropriate for that purpose in the individual\'s own sociocultural setting. The condition may represent an abnormal continuation of normal infantile incontinence, it may involve a loss of continence following the acquisition of bowel control, or it may involve the deliberate deposition of faeces in inappropriate places in spite of normal physiological bowel control. The condition may occur as a monosymptomatic disorder, or it may form part of a wider disorder, especially an emotional disorder (F93.-) or a conduct disorder (F91.-).</div>\n');
INSERT INTO `icd10` VALUES (2750, 4, 2747, 'F98.2', 'Feeding disorder of infancy and childhood', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A feeding disorder of varying manifestations usually specific to infancy and early childhood. It generally involves food refusal and extreme faddiness in the presence of an adequate food supply, a reasonably competent caregiver, and the absence of organic disease. There may or may not be associated rumination (repeated regurgitation without nausea or gastrointestinal illness).</div>\n');
INSERT INTO `icd10` VALUES (2751, 4, 2747, 'F98.3', 'Pica of infancy and childhood', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Persistent eating of non-nutritive substances (such as soil, paint chippings, etc.). It may occur as one of many symptoms that are part of a more widespread psychiatric disorder (such as autism), or as a relatively isolated psychopathological behaviour; only the latter is classified here. The phenomenon is most common in mentally retarded children and, if mental retardation is also present, F70-F79 should be selected as the main diagnosis.</div>\n');
INSERT INTO `icd10` VALUES (2752, 4, 2747, 'F98.4', 'Stereotyped movement disorders', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Voluntary, repetitive, stereotyped, nonfunctional (and often rhythmic) movements that do not form part of any recognized psychiatric or neurological condition. When such movements occur as symptoms of some other disorder, only the overall disorder should be recorded. The movements that are of a non self-injurious variety include: body-rocking, head-rocking, hair-plucking, hair-twisting, finger-flicking mannerisms, and hand-flapping. Stereotyped self-injurious behaviour includes repetitive head-banging, face-slapping, eye-poking, and biting of hands, lips or other body parts. All the stereotyped movement disorders occur most frequently in association with mental retardation (when this is the case, both should be recorded). If eye-poking occurs in a child with visual impairment, both should be coded: eye-poking under this category and the visual condition under the appropriate somatic disorder code.</div>\n');
INSERT INTO `icd10` VALUES (2753, 4, 2747, 'F98.5', 'Stuttering [stammering]', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>Speech that is characterized by frequent repetition or prolongation of sounds or syllables or words, or by frequent hesitations or pauses that disrupt the rhythmic flow of speech. It should be classified as a disorder only if its severity is such as to markedly disturb the fluency of speech.</div>\n');
INSERT INTO `icd10` VALUES (2754, 4, 2747, 'F98.6', 'Cluttering', NULL, '119', '1-057', '2-072', '3-059', '4-044', '<div>A rapid rate of speech with breakdown in fluency, but no repetitions or hesitations, of a severity to give rise to diminished speech intelligibility. Speech is erratic and dysrhythmic, with rapid jerky spurts that usually involve faulty phrasing patterns.</div>\n');
INSERT INTO `icd10` VALUES (2755, 4, 2747, 'F98.8', 'Other specified behavioural and emotional disorders with onset usually occurring in childhood and adolescence', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
INSERT INTO `icd10` VALUES (2756, 4, 2747, 'F98.9', 'Unspecified behavioural and emotional disorders with onset usually occurring in childhood and adolescence', NULL, '119', '1-057', '2-072', '3-059', '4-044', NULL);
