INSERT INTO `icd10` VALUES (2796, 3, 2760, 'G09', 'Sequelae of inflammatory diseases of central nervous system', NULL, '120', '1-061', '2-072', '3-028', '4-021', '<div>Category G09 is to be used to indicate conditions whose primary classification is to G00-G08 (i.e. excluding those marked with an asterisk (*)) as the cause of sequelae, themselves classifiable elsewhere. The "sequelae" include conditions specified as such or as late effects, or those present one year or more after onset of the causal condition. For use of this category reference should be made to the relevant morbidity and mortality coding rules and guidelines in Volume 2.</div>\n<div>Not to be used for chronic inflammatory diseases of the central nervous system. Code these to current inflammatory diseases of the central nervous system.</div>\n');
