INSERT INTO `icd10` VALUES (3948, 3, 3880, 'I69', 'Sequelae of cerebrovascular disease', NULL, '156', '1-069', '2-055', '3-030', '4-044', '<div>\n				<p>Category I69 is to be used to indicate conditions in I60-I67.1 and I67.4-I67.9 as the cause of sequelae, themselves classified elsewhere. The "sequelae" include conditions specified as such or as late effects, or those present one year or more after onset of the causal condition.</p>\n				<p>Not to be used for chronic cerebrovascular disease. Code these to I60-I67.</p>\n			</div>\n');
