INSERT INTO `icd10` VALUES (5200, 4, 5199, 'L89.0', 'Stage I decubitus ulcer and pressure area', NULL, '199', '1-082', '2-072', '3-059', '4-044', '<div>The ulcer appears as a defined area of persistent redness (erythema) in lightly pigmented skin, whereas in darker skin tones, the ulcer may appear with persistent red, blue or purple hues, without skin loss</div>\n');
