INSERT INTO `icd10` VALUES (5261, 2, 5260, 'M00-M03', 'Infectious arthropathies', NULL, NULL, NULL, NULL, NULL, NULL, '<div>\n				<p>This block comprises arthropathies due to microbiological agents.</p>\n				<p>Distinction is made between the following types of etiological relationship:</p>\n				<ul class="loweralpha">\n					<li>\n						<p>direct infection of joint, where organisms invade synovial tissue and microbial antigen is present in the joint;</p>\n					</li>\n					<li>\n						<p>indirect infection, which may be of two types: a <Term class="italics">reactive arthropathy</Term>, where microbial infection of the body is established but neither organisms nor antigens can be identified in the joint, and a <Term class="italics">postinfective arthropathy</Term>, where microbial antigen is present but recovery of an organism is inconstant and evidence of local multiplication is lacking.</p>\n					</li>\n				</ul>\n			</div>\n');
