INSERT INTO `icd10` VALUES (6777, 2, 6339, 'O94-O99', 'Other obstetric conditions, not elsewhere classified', NULL, NULL, NULL, NULL, NULL, NULL, '<div>For use of categories O95-O97 reference should be made to the mortality coding rules and guidelines in Volume 2.</div>\n');
INSERT INTO `icd10` VALUES (6778, 3, 6777, 'O94', 'Sequelae of complication of pregnancy, childbirth and the puerperium', NULL, '244', '1-091', '2-072', NULL, NULL, '<div>This category is to be used for morbidity coding only to indicate conditions in categories O00-O75 and O85-O92 as the cause of sequelae, which are themselves classified elsewhere. The \'sequelae\' include conditions specified as such or as late effects, or those present one year or more after the onset of the causal condition.</div>\n<div>Not to be used for chronic complications of pregnancy, childbirth and the puerperium. Code these to O00-O75 and O85-O92 .</div>\n');
