INSERT INTO `icd10` VALUES (6864, 2, 6809, 'P05-P08', 'Disorders related to length of gestation and fetal growth', NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `icd10` VALUES (6865, 3, 6864, 'P05', 'Slow fetal growth and fetal malnutrition', NULL, '246', '1-092', '2-069', '3-039', '4-026', NULL);
INSERT INTO `icd10` VALUES (6866, 4, 6865, 'P05.0', 'Light for gestational age', NULL, '246', '1-092', '2-069', '3-039', '4-026', '<div>Usually referred to as weight below but length above 10th centile for gestational age.</div>\n');
INSERT INTO `icd10` VALUES (6867, 4, 6865, 'P05.1', 'Small for gestational age', NULL, '246', '1-092', '2-069', '3-039', '4-026', '<div>Usually referred to as weight and length below 10th centile for gestational age.</div>\n');
INSERT INTO `icd10` VALUES (6868, 4, 6865, 'P05.2', 'Fetal malnutrition without mention of light or small for gestational age', NULL, '246', '1-092', '2-069', '3-039', '4-026', '<div>Infant, not light or small for gestational age, showing signs of fetal malnutrition, such as dry, peeling skin and loss of subcutaneous tissue.</div>\n');
INSERT INTO `icd10` VALUES (6869, 4, 6865, 'P05.9', 'Slow fetal growth, unspecified', NULL, '246', '1-092', '2-069', '3-039', '4-026', NULL);
INSERT INTO `icd10` VALUES (6870, 3, 6864, 'P07', 'Disorders related to short gestation and low birth weight, not elsewhere classified', NULL, '246', '1-092', '2-069', '3-039', '4-026', '<div>When both birth weight and gestational age are available, priority of assignment should be given to birth weight.</div>\n');
INSERT INTO `icd10` VALUES (6871, 4, 6870, 'P07.0', 'Extremely low birth weight', NULL, '246', '1-092', '2-069', '3-039', '4-026', '<div>Birth weight 999 g or less.</div>\n');
INSERT INTO `icd10` VALUES (6872, 4, 6870, 'P07.1', 'Other low birth weight', NULL, '246', '1-092', '2-069', '3-039', '4-026', '<div>Birth weight 1000-2499 g.</div>\n');
INSERT INTO `icd10` VALUES (6873, 4, 6870, 'P07.2', 'Extreme immaturity', NULL, '246', '1-092', '2-069', '3-039', '4-026', '<div>Less than 28 completed weeks (less than 196 completed days) of gestation.</div>\n');
INSERT INTO `icd10` VALUES (6874, 4, 6870, 'P07.3', 'Other preterm infants', NULL, '246', '1-092', '2-069', '3-039', '4-026', '<div>28 completed weeks or more but less than 37 completed weeks (196 completed days but less than 259 completed days) of gestation.</div>\n');
INSERT INTO `icd10` VALUES (6875, 3, 6864, 'P08', 'Disorders related to long gestation and high birth weight', NULL, '253', '1-092', '2-069', '3-039', '4-026', '<div>When both birth weight and gestational age are available, priority of assignment should be given to birth weight.</div>\n');
INSERT INTO `icd10` VALUES (6876, 4, 6875, 'P08.0', 'Exceptionally large baby', NULL, '253', '1-092', '2-069', '3-039', '4-026', '<div>Usually implies a birth weight of 4500 g or more.</div>\n');
INSERT INTO `icd10` VALUES (6877, 4, 6875, 'P08.1', 'Other heavy for gestational age infants', NULL, '253', '1-092', '2-069', '3-039', '4-026', '<div>Usually implies a birth weight >90th percentile for gestational age or 4000 g or more at term</div>\n');
INSERT INTO `icd10` VALUES (6878, 4, 6875, 'P08.2', 'Post-term infant, not heavy for gestational age', NULL, '253', '1-092', '2-069', '3-039', '4-026', '<div>Fetus or infant with gestation period of 42 completed weeks or more (294 days or more), not heavy- or large-for-dates.</div>\n');
