INSERT INTO `icd10` VALUES (7924, 1, NULL, 'XVIII', 'Symptoms, signs and abnormal clinical and laboratory findings, not elsewhere classified', NULL, NULL, NULL, NULL, NULL, NULL, '<div>\n				<p>This chapter includes symptoms, signs, abnormal results of clinical or other investigative procedures, and ill-defined conditions regarding which no diagnosis classifiable elsewhere is recorded.</p>\n				<p>Signs and symptoms that point rather definitely to a given diagnosis have been assigned to a category in other chapters of the classification. In general, categories in this chapter include the less well-defined conditions and symptoms that, without the necessary study of the case to establish a final diagnosis, point perhaps equally to two or more diseases or to two or more systems of the body. Practically all categories in the chapter could be designated "not otherwise specified", "unknown etiology" or "transient". The Alphabetical Index should be consulted to determine which symptoms and signs are to be allocated here and which to other chapters. The residual subcategories, numbered .8, are generally provided for other relevant symptoms that cannot be allocated elsewhere in the classification.</p>\n				<p>The conditions and signs or symptoms included in categories R00-R99 consist of:</p>\n				<ul class="loweralpha">\n					<li>\n						<p>cases for which no more specific diagnosis can be made even after all the facts bearing on the case have been investigated;</p>\n					</li>\n					<li>\n						<p>signs or symptoms existing at the time of initial encounter that proved to be transient and whose causes could not be determined;</p>\n					</li>\n					<li>\n						<p>provisional diagnoses in a patient who failed to return for further investigation or care;</p>\n					</li>\n					<li>\n						<p>cases referred elsewhere for investigation or treatment before the diagnosis was made;</p>\n					</li>\n					<li>\n						<p>cases in which a more precise diagnosis was not available for any other reason;</p>\n					</li>\n					<li>\n						<p>certain symptoms, for which supplementary information is provided, that represent important problems in medical care in their own right.</p>\n					</li>\n				</ul>\n			</div>\n');
