INSERT INTO `icd10` VALUES (8276, 1, NULL, 'XIX', 'Injury, poisoning and certain other consequences of external causes', NULL, NULL, NULL, NULL, NULL, NULL, '<div>\n				<p>The chapter uses the S-section for coding different types of injuries related to single body regions and the T-section to cover injuries to multiple or unspecified body regions as well as poisoning and certain other consequences of external causes.</p>\n				<p>Where multiple sites of injury are specified in the titles, the word "with" indicates involvement of both sites, and the word "and" indicates involvement of either or both sites.</p>\n				<p>The principle of multiple coding of injuries should be followed wherever possible. Combination categories for multiple injuries are provided for use when there is insufficient detail as to the nature of the individual conditions, or for primary tabulation purposes when it is more convenient to record a single code; otherwise, the component injuries should be coded separately. Reference should also be made to the morbidity or mortality coding rules and guidelines in Volume 2.</p>\n				<p>The blocks of the S-section as well as T00-T14 and T90-T98 contain injuries at the three-character level classified by type as follows:</p>\n				<p class="termList1"><Term class="bold">Superficial injury </Term>including: </p>\n				<p class="termList2">abrasion</p>\n				<p class="termList2">blister (nonthermal)</p>\n				<p class="termList2">contusion, including bruise and haematoma</p>\n				<p class="termList2">injury from superficial foreign body (splinter) without major open wound</p>\n				<p class="termList3">insect bite (nonvenomous)</p>\n				<p class="termList1"><Term class="bold">Open wound</Term> including: </p>\n				<p class="termList2">animal bite</p>\n				<p class="termList2">cut</p>\n				<p class="termList2">laceration</p>\n				<p class="termList2">puncture wound:</p>\n				<ul>\n					<li>\n						<p class="termList2">NOS</p>\n					</li>\n					<li>\n						<p class="termList2">with (penetrating) foreign body</p>\n					</li>\n				</ul>\n				<p class="termList1"><Term class="bold">Fracture </Term> including: </p>\n				<p class="termList2">Fracture:</p>\n				<Table>\n					<TBody>\n						<Row>\n							<Cell>\n								<p>closed:</p>\n								<ul>\n									<li>\n										<p>comminuted</p>\n									</li>\n									<li>\n										<p>depressed</p>\n									</li>\n									<li>\n										<p>elevated</p>\n									</li>\n									<li>\n										<p>fissured</p>\n									</li>\n									<li>\n										<p>greenstick</p>\n									</li>\n									<li>\n										<p>impacted</p>\n									</li>\n									<li>\n										<p>linear</p>\n									</li>\n									<li>\n										<p>march</p>\n									</li>\n									<li>\n										<p>simple</p>\n									</li>\n									<li>\n										<p>slipped epiphysis</p>\n									</li>\n									<li>\n										<p>spiral</p>\n									</li>\n								</ul>\n							</Cell>\n							<Cell>\n								<p>with or without delayed healing</p>\n							</Cell>\n						</Row>\n					</TBody>\n				</Table>\n				<ul>\n					<li>\n						<p class="termList2">dislocated</p>\n					</li>\n					<li>\n						<p class="termList2">displaced</p>\n					</li>\n				</ul>\n			</div>\n<div>\n				<p class="termList2">Fracture:</p>\n				<Table>\n					<TBody>\n						<Row>\n							<Cell>\n								<p>open:</p>\n								<ul>\n									<li>\n										<p>compound</p>\n									</li>\n									<li>\n										<p>infected</p>\n									</li>\n									<li>\n										<p>missile</p>\n									</li>\n									<li>\n										<p>puncture</p>\n									</li>\n									<li>\n										<p>with foreign body</p>\n									</li>\n								</ul>\n							</Cell>\n							<Cell>\n								<p>with or without delayed healing</p>\n							</Cell>\n						</Row>\n					</TBody>\n				</Table>\n				<p class="chpt-terms1"><Term class="Zinkl">Excl.:</Term><Term class="tab"/>fracture:</p>\n				<p class="chpt-terms2">- pathological<Reference class="in brackets" code="M84.4">M84.4</Reference></p>\n				<p class="chpt-terms2">-- with osteoporosis<Reference class="in brackets" code="M80">M80.-</Reference></p>\n				<p class="chpt-terms2">- stress<Reference class="in brackets" code="M84.3">M84.3</Reference></p>\n				<p class="chpt-terms2">malunion of fracture<Reference class="in brackets" code="M84.0">M84.0</Reference></p>\n				<p class="chpt-terms2">nonunion of fracture<Reference class="in brackets" code="M84.1">M84.1</Reference></p>\n				<p class="termList1"><Term class="bold">Dislocation, sprain and strain</Term> including:</p>\n				<Table>\n					<TBody>\n						<Row>\n							<Cell>\n								<p>avulsion</p>\n								<p>laceration</p>\n								<p>sprain</p>\n								<p>strain</p>\n								<p>traumatic:</p>\n								<ul>\n									<li>\n										<p>haemarthrosis</p>\n									</li>\n									<li>\n										<p>rupture</p>\n									</li>\n									<li>\n										<p>subluxation</p>\n									</li>\n									<li>\n										<p>tear</p>\n									</li>\n								</ul>\n							</Cell>\n							<Cell>\n								<p>of</p>\n							</Cell>\n							<Cell>\n								<p>cartilage</p>\n								<p>joint (capsule)</p>\n								<p>ligament</p>\n							</Cell>\n						</Row>\n					</TBody>\n				</Table>\n				<p class="termList1"><Term class="bold">Injury to nerves and spinal cord </Term>including:</p>\n				<p class="termList2">complete or incomplete lesion of spinal cord</p>\n				<p class="termList2">lesion in continuity of nerves and spinal cord</p>\n				<p class="termList2">traumatic:</p>\n				<ul>\n					<li>\n						<p class="termList2">division of nerve</p>\n					</li>\n					<li>\n						<p class="termList2">haematomyelia</p>\n					</li>\n					<li>\n						<p class="termList2">paralysis(transient)</p>\n					</li>\n					<li>\n						<p class="termList2">paraplegia</p>\n					</li>\n					<li>\n						<p class="termList3">quadriplegia</p>\n					</li>\n				</ul>\n				<p class="termList1"><Term class="bold">Injury to blood vessels </Term>including:</p>\n				<Table>\n					<TBody>\n						<Row>\n							<Cell>\n								<p>avulsion</p>\n								<p>cut</p>\n								<p>laceration</p>\n								<p>traumatic:</p>\n								<ul>\n									<li>\n										<p>aneurysm or fistula (arteriovenous)</p>\n									</li>\n									<li>\n										<p>arterial haematoma</p>\n									</li>\n									<li>\n										<p>rupture</p>\n									</li>\n								</ul>\n							</Cell>\n							<Cell>\n								<p>of blood vessels</p>\n								<p/>\n							</Cell>\n						</Row>\n					</TBody>\n				</Table>\n			</div>\n<div>\n				<p class="termList1"><Term class="bold">Injury to muscle, fascia and tendon</Term> including:</p>\n				<Table>\n					<TBody>\n						<Row>\n							<Cell>\n								<p>avulsion</p>\n								<p>cut</p>\n								<p>laceration</p>\n								<p>strain</p>\n								<p>traumatic rupture</p>\n							</Cell>\n							<Cell>\n								<p>of muscle, fascia and tendon</p>\n							</Cell>\n						</Row>\n					</TBody>\n				</Table>\n			</div>\n<div>\n					\n				</div>\n<div>\n					\n				</div>\n<div>\n				<p class="termList1"><Term class="bold">Injury to internal organs</Term> including:</p>\n				<Table>\n					<TBody>\n						<Row>\n							<Cell>\n								<p>blast injuries</p>\n								<p>bruise</p>\n								<p>concussion injuries</p>\n								<p>crushing</p>\n								<p>laceration</p>\n								<p>traumatic:</p>\n								<ul>\n									<li>\n										<p>haematoma</p>\n									</li>\n									<li>\n										<p>puncture</p>\n									</li>\n									<li>\n										<p>rupture</p>\n									</li>\n									<li>\n										<p>tear</p>\n									</li>\n								</ul>\n							</Cell>\n							<Cell>\n								<p>of internal organs</p>\n							</Cell>\n						</Row>\n					</TBody>\n				</Table>\n				<p class="termList1-last">\n					<Term class="bold">Other and unspecified injuries</Term>\n				</p>\n			</div>\n');
