INSERT INTO `icd10` VALUES (9701, 2, 8276, 'T90-T98', 'Sequelae of injuries, of poisoning and of other consequences of external causes', NULL, NULL, NULL, NULL, NULL, NULL, '<div>Categories T90-T98 are to be used to indicate conditions in S00-S99 and T00-T88 as the cause of late effects, which are themselves classified elsewhere. The "sequelae" include those specified as such, or as late effects, and those present one year or more after the acute injury.</div>\n');
