INSERT INTO `icd10` VALUES (9758, 1, NULL, 'XX', 'External causes of morbidity and mortality', NULL, NULL, NULL, NULL, NULL, NULL, '<div>\n				<p>This chapter, which in previous revisions of ICD constituted a supplementary classification, permits the classification of environmental events and circumstances as the cause of injury, poisoning and other adverse effects. Where a code from this section is applicable, it is intended that it shall be used in addition to a code from another chapter of the Classification indicating the nature of the condition. Most often, the condition will be classifiable to Chapter XIX, Injury, poisoning and certain other consequences of external causes (S00-T98). Causes of death should preferably be tabulated according to both Chapter XIX and Chapter XX, but if only one code is tabulated then the code from Chapter XX should be used in preference. Other conditions that may be stated to be due to external causes are classified in Chapters I to XVIII. For these conditions, codes from Chapter XX should be used to provide additional information for multiple-condition analysis only.</p>\n				<p>Categories for sequelae of external causes of morbidity and mortality are included at Y85-Y89.</p>\n			</div>\n');
INSERT INTO `icd10` VALUES (9759, 2, 9758, 'V01-X59', 'Accidents', NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO `icd10` VALUES (9760, 2, 9759, 'V01-V99', 'Transport accidents', NULL, NULL, NULL, NULL, NULL, NULL, '<div>This section is structured in 12 groups. Those relating to land transport accidents (V01-V89) reflect the victim\'s mode of transport and are subdivided to identify the victim\'s "counterpart" or the type of event. The vehicle of which the injured person is an occupant is identified in the first two characters since it is seen as the most important factor to identify for prevention purposes.</div>\n<div>\n				<p class="head-ital-14">Definitions related to transport accidents</p>\n				<p class="chpt-spec1-last">(a)<Term class="tab"/>A transport accident (V01–V99) is any accident involving a device designed primarily for, or being used at the time primarily for, conveying persons or goods from one place to another.</p>\n				<p class="chpt-spec1-last">(b)<Term class="tab"/>A public highway [trafficway] or street is the entire width between property lines (or other boundary lines) of land open to the public as a matter of right or custom for purposes of moving persons or property from one place to another. A roadway is that part of the public highway designed, improved and customarily used for vehicular traffic.</p>\n				<p class="chpt-spec1-last">(c)<Term class="tab"/>A traffic accident is any vehicle accident occurring on the public highway [i.e. originating on, terminating on, or involving a vehicle partially on the highway]. A vehicle accident is assumed to have occurred on the public highway unless another place is specified, except in the case of accidents involving only off-road motor vehicles, which are classified as nontraffic accidents unless the contrary is stated.</p>\n				<p class="chpt-spec1-last">(d)<Term class="tab"/>A nontraffic accident is any vehicle accident that occurs entirely in any place other than a public highway.</p>\n				<p class="chpt-spec1">(e)<Term class="tab"/>A pedestrian is any person involved in an accident who was not at the time of the accident riding in or on a motor vehicle, railway train, streetcar or animal-drawn or other vehicle, or on a pedal cycle or animal.</p>\n				<p class="chpt-spec-terms1"><Term class="Zinkl">Incl.:</Term><Term class="tab"/>person:</p>\n				<ul class="bullet">\n					<li>\n						<p class="chpt-spec-terms2">making adjustment to motor of vehicle</p>\n					</li>\n					<li>\n						<p class="chpt-spec-terms2">changing tyre of vehicle</p>\n					</li>\n					<li>\n						<p class="chpt-spec-terms2-last">on foot</p>\n					</li>\n				</ul>\n				<p class="chpt-spec-terms2">user of a pedestrian conveyance such as:</p>\n				<ul class="bullet">\n					<li>\n						<p class="chpt-spec-terms2">baby carriage</p>\n					</li>\n					<li>\n						<p class="chpt-spec-terms2">ice-skates</p>\n					</li>\n					<li>\n						<p class="chpt-spec-terms2">perambulator</p>\n					</li>\n					<li>\n						<p class="chpt-spec-terms2">push-cart</p>\n					</li>\n					<li>\n						<p class="chpt-spec-terms2">push-chair</p>\n					</li>\n					<li>\n						<p class="chpt-spec-terms2">roller-skates</p>\n					</li>\n					<li>\n						<p class="chpt-spec-terms2">scooter</p>\n					</li>\n					<li>\n						<p class="chpt-spec-terms2">skateboard</p>\n					</li>\n					<li>\n						<p class="chpt-spec-terms2">skis</p>\n					</li>\n					<li>\n						<p class="chpt-spec-terms2">sled</p>\n					</li>\n					<li>\n						<p class="chpt-spec-terms2">wheelchair (powered)</p>\n					</li>\n				</ul>\n				<p class="chpt-spec1-last">(f)<Term class="tab"/>A driver is an occupant of a transport vehicle who is operating or intending to operate it.</p>\n				<p class="chpt-spec1">(g)<Term class="tab"/>A passenger is any occupant of a transport vehicle other than the driver.</p>\n				<p class="chpt-spec-terms1-last"><Term class="Zinkl">Excl.:</Term><Term class="tab"/>person travelling on outside of vehicle – see definition (h)</p>\n				<p class="chpt-spec1">(h)<Term class="tab"/>A person on outside of vehicle is any person being transported by a vehicle but not occupying the space normally reserved for the driver or passengers, or the space intended for the transport of property.</p>\n				<p class="chpt-spec-terms1"><Term class="Zinkl">Incl.:</Term><Term class="tab"/>person (travelling on):</p>\n				<ul class="bullet">\n					<li>\n						<p class="chpt-spec-terms2">bodywork</p>\n					</li>\n					<li>\n						<p class="chpt-spec-terms2">bumper [fender]</p>\n					</li>\n					<li>\n						<p class="chpt-spec-terms2">hanging on outside</p>\n					</li>\n					<li>\n						<p class="chpt-spec-terms2">roof (rack)</p>\n					</li>\n					<li>\n						<p class="chpt-spec-terms2">running-board</p>\n					</li>\n					<li>\n						<p class="chpt-spec-terms2-last">step</p>\n					</li>\n				</ul>\n				<p class="chpt-spec1">(i)<Term class="tab"/>A pedal cycle is any land transport vehicle operated solely by pedals.</p>\n				<p class="chpt-spec-terms1"><Term class="Zinkl">Incl.:</Term><Term class="tab"/>bicycle</p>\n				<p class="chpt-spec-terms2">tricycle</p>\n				<p class="chpt-spec-terms1-last"><Term class="Zinkl">Excl.:</Term><Term class="tab"/>motorized bicycle – see definition (k)</p>\n				<p class="chpt-spec1-last">(j)<Term class="tab"/>A pedal cyclist is any person riding on a pedal cycle or in a sidecar or trailer attached to such a vehicle.</p>\n				<p class="chpt-spec1">(k)<Term class="tab"/>A motorcycle is a two-wheeled motor vehicle with one or two riding saddles and sometimes with a third wheel for the support of a sidecar. The sidecar is considered part of the motorcycle.</p>\n				<p class="chpt-spec-terms1"><Term class="Zinkl">Incl.:</Term><Term class="tab"/>moped</p>\n				<p class="chpt-spec-terms2">motor scooter</p>\n				<p class="chpt-spec-terms2">motorcycle:</p>\n				<ul class="bullet">\n					<li>\n						<p class="chpt-spec-terms2">NOS</p>\n					</li>\n					<li>\n						<p class="chpt-spec-terms2">combination</p>\n					</li>\n					<li>\n						<p class="chpt-spec-terms2">with sidecar</p>\n					</li>\n				</ul>\n				<p class="chpt-spec-terms2">motorized bicycle</p>\n				<p class="chpt-spec-terms2">speed-limited motor-driven cycle</p>\n				<p class="chpt-spec-terms1-last"><Term class="Zinkl">Excl.:</Term><Term class="tab"/>motor-driven tricycle – see definition (m)</p>\n				<p class="chpt-spec1-last">(l)<Term class="tab"/>A motorcycle rider is any person riding on a motorcycle or in a sidecar or trailer attached to such a vehicle.</p>\n				<p class="chpt-spec1">(m)<Term class="tab"/>A three-wheeled motor vehicle is a motorized tricycle designed primarily for on- road use.</p>\n				<p class="chpt-spec-terms1"><Term class="Zinkl">Incl.:</Term><Term class="tab"/>motor-driven tricycle</p>\n				<p class="chpt-spec-terms2">motorized rickshaw</p>\n				<p class="chpt-spec-terms2">three-wheeled motor car</p>\n				<p class="chpt-spec-terms1"><Term class="Zinkl">Excl.:</Term><Term class="tab"/>motorcycle with sidecar – see definition (k)</p>\n				<p class="chpt-spec-terms2-last">special all-terrain vehicle – see definition (x)</p>\n				<p class="chpt-spec1-last">(n)<Term class="tab"/>A car [automobile] is a four-wheeled motor vehicle designed primarily for carrying up to 10 persons. A trailer or caravan being towed by a car is considered a part of the car.</p>\n				<p class="chpt-spec-terms1-last"><Term class="Zinkl">Incl.:</Term><Term class="tab"/>minibus</p>\n				<p class="chpt-spec1-last">(o)<Term class="tab"/>A motor vehicle or vehicle may refer to various transport vehicles. The local usage of the terms should be established to determine the appropriate code. If the terms are used ambiguously, use the code for “unspecified”. A trailer or caravan being towed by a vehicle is considered a part of the vehicle.</p>\n				<p class="chpt-spec1-last">(p)<Term class="tab"/>A pick-up truck or van is a four- or six-wheeled motor vehicle designed primarily for carrying property, weighing less than the local limit for classification as a heavy goods vehicle, and not requiring a special driver’s licence.</p>\n				<p class="chpt-spec1">(q)<Term class="tab"/>A heavy transport vehicle is a motor vehicle designed primarily for carrying property, meeting local criteria for classification as a heavy goods vehicle in terms of kerbside weight (usually above 3500 kg), and requiring a special driver’s licence.</p>\n				<p class="chpt-spec1">(r)<Term class="tab"/>A bus is a motor vehicle designed or adapted primarily for carrying more than 10 persons, and requiring a special driver’s licence.</p>\n				<p class="chpt-spec-terms1"><Term class="Zinkl">Incl.:</Term><Term class="tab"/>coach</p>\n				<p class="chpt-spec1">(s)<Term class="tab"/>A railway train or railway vehicle is any device, with or without cars coupled to it, designed for traffic on a railway.</p>\n				<p class="chpt-spec-terms1"><Term class="Zinkl">Incl.:</Term><Term class="tab"/>interurban:</p>\n				<ul class="bullet">\n					<li>\n						<p class="chpt-spec-terms2">electric car (operated chiefly on its own right-of-way, not open to other traffic)</p>\n					</li>\n					<li>\n						<p class="chpt-spec-terms2">street car (operated chiefly on its own right-of-way, not open to other traffic)</p>\n					</li>\n				</ul>\n				<p class="chpt-spec-terms2">railway train, any power [diesel] [electric] [steam]:</p>\n				<ul class="bullet">\n					<li>\n						<p class="chpt-spec-terms2">funicular</p>\n					</li>\n					<li>\n						<p class="chpt-spec-terms2">monorail or two-rail</p>\n					</li>\n					<li>\n						<p class="chpt-spec-terms2">subterranean or elevated</p>\n					</li>\n				</ul>\n				<p class="chpt-spec-terms2">other vehicle designed to run on a railway track</p>\n				<p class="chpt-spec-terms1"><Term class="Zinkl">Excl.:</Term><Term class="tab"/>interurban electric cars [streetcars] specified to be operating on a right-of- way that forms part of the public street or highway – see definition (t)</p>\n				<p class="chpt-spec1">(t)<Term class="tab"/>A streetcar is a device designed and used primarily for transporting persons within a municipality, running on rails, usually subject to normal traffic control signals, and operated principally on a right-of-way that forms part of the roadway. A trailer being towed by a streetcar is considered a part of the streetcar.</p>\n				<p class="chpt-spec-terms1"><Term class="Zinkl">Incl.:</Term><Term class="tab"/>interurban electric car or streetcar, when specified to be operating on a street or public highway</p>\n				<p class="chpt-spec-terms2">tram (car)</p>\n				<p class="chpt-spec-terms2-last">trolley (car)</p>\n				<p class="chpt-spec1">(u)<Term class="tab"/>A special vehicle mainly used on industrial premises is a motor vehicle designed primarily for use within the buildings and premises of industrial or commercial establishments.</p>\n				<p class="chpt-spec-terms1"><Term class="Zinkl">Incl.:</Term><Term class="tab"/>battery-powered:</p>\n				<ul class="bullet">\n					<li>\n						<p class="chpt-spec-terms2">airport passenger vehicle</p>\n					</li>\n					<li>\n						<p class="chpt-spec-terms2">truck (baggage)(mail)</p>\n					</li>\n				</ul>\n				<p class="chpt-spec-terms2">coal-car in mine</p>\n				<p class="chpt-spec-terms2">forklift (truck)</p>\n				<p class="chpt-spec-terms2">logging car</p>\n				<p class="chpt-spec-terms2">self-propelled truck, industrial</p>\n				<p class="chpt-spec-terms2">station baggage truck (powered)</p>\n				<p class="chpt-spec-terms2-last">tram, truck or tub (powered) in mine or quarry</p>\n				<p class="chpt-spec1">(v)<Term class="tab"/>A special vehicle mainly used in agriculture is a motor vehicle designed specifically for use in farming and agriculture (horticulture), for example to work the land, tend and harvest crops and transport materials on the farm.</p>\n				<p class="chpt-spec-terms1"><Term class="Zinkl">Incl.:</Term><Term class="tab"/>combine harvester</p>\n				<p class="chpt-spec-terms2">self-propelled farm machinery</p>\n				<p class="chpt-spec-terms2-last">tractor (and trailer)</p>\n				<p class="chpt-spec1">(w)<Term class="tab"/>A special construction vehicle is a motor vehicle designed specifically for use in the construction (and demolition) of roads, buildings and other structures.</p>\n				<p class="chpt-spec-terms1"><Term class="Zinkl">Incl.:</Term><Term class="tab"/>bulldozer</p>\n				<p class="chpt-spec-terms2">digger</p>\n				<p class="chpt-cont2-l2">dumper truck</p>\n				<p class="chpt-spec-terms2">earth-leveller</p>\n				<p class="chpt-spec-terms2">mechanical shovel</p>\n				<p class="chpt-spec-terms2-last">road-roller</p>\n				<p class="chpt-spec1">(x)<Term class="tab"/>A special all-terrain vehicle is a motor vehicle of special design to enable it to negotiate rough or soft terrain or snow. Examples of special design are high construction, special wheels and tyres, tracks, and support on a cushion of air.</p>\n				<p class="chpt-spec-terms1"><Term class="Zinkl">Incl.:</Term><Term class="tab"/>hovercraft on land or swamp</p>\n				<p class="chpt-spec-terms2">snowmobile</p>\n				<p class="chpt-spec-terms1-last"><Term class="Zinkl">Excl.:</Term><Term class="tab"/>hovercraft on open water – see definition (y)</p>\n				<p class="chpt-spec1">(y)<Term class="tab"/>A watercraft is any device for transporting passengers or goods on water.</p>\n				<p class="chpt-spec-terms1-last"><Term class="Zinkl">Incl.:</Term><Term class="tab"/>hovercraft NOS</p>\n				<p class="chpt-spec1-last">(z)<Term class="tab"/>An aircraft is any device for transporting passengers or goods in the air.</p>\n			</div>\n<div>\n				<p class="head-ital-14">Classification and coding instructions for transport accidents</p>\n				<p class="chpt-spec1">1.<Term class="tab"/>If an event is unspecified as to whether it was a traffic or a nontraffic accident, it is assumed to be:</p>\n				<ul class="loweralpha">\n					<li>\n						<p class="chpt-spec2">A traffic accident when the event is classifiable to categories V10–V82 and V87.</p>\n					</li>\n					<li>\n						<p class="chpt-spec2-last">A nontraffic accident when the event is classifiable to categories V83–V86. For these categories the victim is either a pedestrian, or an occupant of a vehicle designed primarily for off-road use.</p>\n					</li>\n				</ul>\n				<p class="chpt-spec1">2.<Term class="tab"/>When accidents involving more than one kind of transport are reported, the following order of precedence should be used:</p>\n				<p class="chpt-spec4">aircraft and spacecraft (V95–V97)</p>\n				<p class="chpt-spec3">watercraft (V90–V94)</p>\n				<p class="chpt-spec3-last">other modes of transport (V01–V89, V98–V99)</p>\n				<p class="chpt-spec1">3.<Term class="tab"/>Where transport accident descriptions do not specify the victim as being a vehicle occupant and the victim is described as:</p>\n				<Table class="std-topmargin">\n					<TBody>\n						<Row>\n							<Cell>\n								<p class="chpt-spec3-tab">crushed</p>\n								<p class="chpt-spec3-tab">dragged</p>\n								<p class="chpt-spec3-tab">hit</p>\n								<p class="chpt-spec3-tab">injured</p>\n								<p class="chpt-spec3-tab">killed</p>\n								<p class="chpt-spec3-tab">knocked down</p>\n								<p class="chpt-spec3-tab">run over</p>\n							</Cell>\n							<Cell>\n								<p class="tab-col2">by any vehicle including</p>\n							</Cell>\n							<Cell>\n								<p class="tab-col2">animal being ridden</p>\n								<p class="tab-col2">animal-drawn vehicle</p>\n								<p class="tab-col2">bicycle</p>\n								<p class="tab-col2">bulldozer</p>\n								<p class="tab-col2">bus</p>\n								<p class="tab-col2">car</p>\n								<p class="tab-col2">motorcycle</p>\n								<p class="tab-col2">motorized tricycle</p>\n								<p class="tab-col2">pick-up (truck)</p>\n								<p class="tab-col2">recreational vehicle</p>\n								<p class="tab-col2">streetcar</p>\n								<p class="tab-col2">tractor</p>\n								<p class="tab-col2">train</p>\n								<p class="tab-col2">tram</p>\n								<p class="tab-col2">truck</p>\n								<p class="tab-col2">van</p>\n							</Cell>\n						</Row>\n					</TBody>\n				</Table>\n				<p class="chpt-spec3">classify the victim as a pedestrian (categories V01–V09).</p>\n				<p class="chpt-spec1">4.<Term class="tab"/>Where transport accident descriptions do not indicate the victim’s role, such as:</p>\n				<Table class="std-topmargin">\n					<TBody>\n						<Row>\n							<Cell>\n								<p class="chpt-spec3-tab">airplane</p>\n								<p class="chpt-spec3-tab">bicycle</p>\n								<p class="chpt-spec3-tab">boat</p>\n								<p class="chpt-spec3-tab">bulldozer</p>\n								<p class="chpt-spec3-tab">bus</p>\n								<p class="chpt-spec3-tab">car</p>\n								<p class="chpt-spec3-tab">motorcycle</p>\n								<p class="chpt-spec3-tab">motorized tricycle</p>\n								<p class="chpt-spec3-tab">pick-up (truck)</p>\n								<p class="chpt-spec3-tab">recreational vehicle</p>\n								<p class="chpt-spec3-tab">spacecraft</p>\n								<p class="chpt-spec3-tab">streetcar</p>\n								<p class="chpt-spec3-tab">tractor</p>\n								<p class="chpt-spec3-tab">train</p>\n								<p class="chpt-spec3-tab">tram</p>\n								<p class="chpt-spec3-tab">truck</p>\n								<p class="chpt-spec3-tab">van</p>\n								<p class="chpt-spec3-tab">watercraft</p>\n							</Cell>\n							<Cell>\n								<p class="tab-col2">accident</p>\n								<p class="tab-col2">collision</p>\n								<p class="tab-col2">crash</p>\n								<p class="tab-col2">wreck</p>\n							</Cell>\n							<Cell>\n								<p class="tab-col2">NOS</p>\n							</Cell>\n						</Row>\n					</TBody>\n				</Table>\n				<p class="chpt-spec3">classify the victim as an occupant or rider of the vehicle mentioned.</p>\n				<p class="chpt-spec4-last">If more than one vehicle is mentioned, do not make any assumption as to which vehicle was occupied by the victim unless the vehicles are the same. Instead, code to the appropriate categories V87–V88, V90–V94, V95–V97, taking into account the order of precedence given in note 2 above.</p>\n				<p class="chpt-spec1">5.<Term class="tab"/>Where a transport accident, such as:</p>\n				<p class="chpt-spec4">vehicle (motor)(nonmotor):</p>\n				<ul class="bullet">\n					<li>\n						<p class="chpt-spec3">failing to make curve</p>\n					</li>\n					<li>\n						<p class="chpt-spec3">going out of control (due to):</p>\n						<ul class="bullet">\n							<li>\n								<p class="chpt-spec3">burst tyre [blowout]</p>\n							</li>\n							<li>\n								<p class="chpt-spec3">driver falling asleep</p>\n							</li>\n							<li>\n								<p class="chpt-spec3">driver inattention</p>\n							</li>\n							<li>\n								<p class="chpt-spec3">excessive speed</p>\n							</li>\n							<li>\n								<p class="chpt-spec3">failure of mechanical part</p>\n							</li>\n						</ul>\n					</li>\n				</ul>\n				<p class="chpt-spec4-last">resulted in a subsequent collision, classify the accident as a collision. If an accident other than a collision resulted, classify it as a noncollision accident according to the vehicle type involved.</p>\n				<p class="chpt-spec1">6.<Term class="tab"/>Where a transport accident involving a vehicle in motion, such as:</p>\n				<Table class="keep-with-next">\n					<TBody>\n						<Row>\n							<Cell>\n								<p class="chpt-spec3-tab">accidental poisoning from exhaust gas generated by</p>\n								<p class="chpt-spec3-tab">breakage of any part of</p>\n								<p class="chpt-spec3-tab">explosion of any part of</p>\n								<p class="chpt-spec3-tab">fall, jump or being accidentally pushed from or restarting in</p>\n								<p class="chpt-spec3-tab">hit by object thrown into or onto</p>\n								<p class="chpt-spec3-tab">injured by being thrown against some part of, or object in</p>\n								<p class="chpt-spec3-tab">injury from moving part of</p>\n								<p class="chpt-spec3-tab">object falling in or on</p>\n							</Cell>\n							<Cell>\n								<p class="tab-col2">vehicle in motion</p>\n							</Cell>\n						</Row>\n					</TBody>\n				</Table>\n				<p class="chpt-spec3">resulted in a subsequent collision, classify the accident as a collision. If an accident other than a collision resulted, classify it as a noncollision accident according to the vehicle type involved.</p>\n				<p class="chpt-spec1">7.<Term class="tab"/>Land transport accidents described as:</p>\n				<p class="chpt-spec4">collision (due to loss of control)(on highway) between vehicle and:</p>\n				<Table class="keep-with-next">\n					<TBody>\n						<Row>\n							<Cell>\n								<ul class="bullet">\n									<li>\n										<p class="chpt-spec3-tab">abutment(bridge)(overpass)</p>\n									</li>\n									<li>\n										<p class="chpt-spec3-tab">fallen stone</p>\n									</li>\n									<li>\n										<p class="chpt-spec3-tab">guard rail or boundary fence</p>\n									</li>\n									<li>\n										<p class="chpt-spec3-tab">inter-highway divider</p>\n									</li>\n									<li>\n										<p class="chpt-spec3-tab">landslide (not moving)</p>\n									</li>\n									<li>\n										<p class="chpt-spec3-tab">object thrown in front of motor vehicle</p>\n									</li>\n									<li>\n										<p class="chpt-spec3-tab">safety island</p>\n									</li>\n									<li>\n										<p class="chpt-spec3-tab">tree</p>\n									</li>\n									<li>\n										<p class="chpt-spec3-tab">traffic sign or marker (temporary)</p>\n									</li>\n									<li>\n										<p class="chpt-spec3-tab">utility pole</p>\n									</li>\n									<li>\n										<p class="chpt-spec3-tab">wall of cut made for road</p>\n									</li>\n									<li>\n										<p class="chpt-spec3-tab">other object, fixed, movable or moving</p>\n									</li>\n								</ul>\n							</Cell>\n							<Cell>\n								<p class="tab-col2">are included in V17, V27, V37, V47, V57, V67 and V77</p>\n							</Cell>\n						</Row>\n					</TBody>\n				</Table>\n				<p class="chpt-spec3">overturning (without collision) are included in V18, V28, V38, V48, V58, V68, and V78</p>\n				<p class="chpt-spec3">collision with animal (herded)(unattended) are included in V10, V20, V30, V40, V50, V60 and V70</p>\n				<p class="chpt-spec3-last">collision with animal-drawn vehicle or animal being ridden are included in V16, V26, V36, V46, V56, V66 and V76.</p>\n			</div>\n');
