INSERT INTO `icd10` VALUES (11065, 3, 11014, 'Z60', 'Problems related to social environment', NULL, '298', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `icd10` VALUES (11066, 4, 11065, 'Z60.0', 'Problems of adjustment to life-cycle transitions', NULL, '298', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `icd10` VALUES (11067, 4, 11065, 'Z60.1', 'Atypical parenting situation', NULL, '298', NULL, NULL, NULL, NULL, '<div>Problems related to a parenting situation (rearing of children) with a single parent or other than that of two cohabiting biological parents.</div>\n');
INSERT INTO `icd10` VALUES (11068, 4, 11065, 'Z60.2', 'Living alone', NULL, '298', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `icd10` VALUES (11069, 4, 11065, 'Z60.3', 'Acculturation difficulty', NULL, '298', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `icd10` VALUES (11070, 4, 11065, 'Z60.4', 'Social exclusion and rejection', NULL, '298', NULL, NULL, NULL, NULL, '<div>Exclusion and rejection on the basis of personal characteristics, such as unusual physical appearance, illness or behaviour.</div>\n');
INSERT INTO `icd10` VALUES (11071, 4, 11065, 'Z60.5', 'Target of perceived adverse discrimination and persecution', NULL, '298', NULL, NULL, NULL, NULL, '<div>Persecution or discrimination, perceived or real, on the basis of membership of some group (as defined by skin colour, religion, ethnic origin, etc.) rather than personal characteristics.</div>\n');
INSERT INTO `icd10` VALUES (11072, 4, 11065, 'Z60.8', 'Other problems related to social environment', NULL, '298', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `icd10` VALUES (11073, 4, 11065, 'Z60.9', 'Problem related to social environment, unspecified', NULL, '298', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `icd10` VALUES (11074, 3, 11014, 'Z61', 'Problems related to negative life events in childhood', NULL, '298', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `icd10` VALUES (11075, 4, 11074, 'Z61.0', 'Loss of love relationship in childhood', NULL, '298', NULL, NULL, NULL, NULL, '<div>Loss of an emotionally close relationship, such as of a parent, a sibling, a very special friend or a loved pet, by death or permanent departure or rejection.</div>\n');
INSERT INTO `icd10` VALUES (11076, 4, 11074, 'Z61.1', 'Removal from home in childhood', NULL, '298', NULL, NULL, NULL, NULL, '<div>Admission to a foster home, hospital or other institution causing psychosocial stress, or forced conscription into an activity away from home for a prolonged period.</div>\n');
INSERT INTO `icd10` VALUES (11077, 4, 11074, 'Z61.2', 'Altered pattern of family relationships in childhood', NULL, '298', NULL, NULL, NULL, NULL, '<div>Arrival of a new person into a family resulting in adverse change in child\'s relationships. May include new marriage by a parent or birth of a sibling.</div>\n');
INSERT INTO `icd10` VALUES (11078, 4, 11074, 'Z61.3', 'Events resulting in loss of self-esteem in childhood', NULL, '298', NULL, NULL, NULL, NULL, '<div>Events resulting in a negative self-reappraisal by the child such as failure in tasks with high personal investment; disclosure or discovery of a shameful or stigmatizing personal or family event; and other humiliating experiences.</div>\n');
INSERT INTO `icd10` VALUES (11079, 4, 11074, 'Z61.4', 'Problems related to alleged sexual abuse of child by person within primary support group', NULL, '298', NULL, NULL, NULL, NULL, '<div>Problems related to any form of physical contact or exposure between an adult member of the child\'s household and the child that has led to sexual arousal, whether or not the child has willingly engaged in the sexual acts (e.g. any genital contact or manipulation or deliberate exposure of breasts or genitals).</div>\n');
INSERT INTO `icd10` VALUES (11080, 4, 11074, 'Z61.5', 'Problems related to alleged sexual abuse of child by person outside primary support group', NULL, '298', NULL, NULL, NULL, NULL, '<div>Problems related to contact or attempted contact with the child\'s or the other person\'s breasts or genitals, sexual exposure in close confrontation or attempt to undress or seduce the child, by a substantially older person outside the child\'s family, either on the basis of this person\'s position or status or against the will of the child.</div>\n');
INSERT INTO `icd10` VALUES (11081, 4, 11074, 'Z61.6', 'Problems related to alleged physical abuse of child', NULL, '298', NULL, NULL, NULL, NULL, '<div>Problems related to incidents in which the child has been injured in the past by any adult in the household to a medically significant extent (e.g. fractures, marked bruising) or that involved abnormal forms of violence (e.g. hitting the child with hard or sharp implements, burning or tying up of the child).</div>\n');
INSERT INTO `icd10` VALUES (11082, 4, 11074, 'Z61.7', 'Personal frightening experience in childhood', NULL, '298', NULL, NULL, NULL, NULL, '<div>Experience carrying a threat for the child\'s future, such as a kidnapping, natural disaster with a threat to life, injury with a threat to self-image or security, or witnessing a severe trauma to a loved one.</div>\n');
INSERT INTO `icd10` VALUES (11083, 4, 11074, 'Z61.8', 'Other negative life events in childhood', NULL, '298', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `icd10` VALUES (11084, 4, 11074, 'Z61.9', 'Negative life event in childhood, unspecified', NULL, '298', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `icd10` VALUES (11085, 3, 11014, 'Z62', 'Other problems related to upbringing', NULL, '298', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `icd10` VALUES (11086, 4, 11085, 'Z62.0', 'Inadequate parental supervision and control', NULL, '298', NULL, NULL, NULL, NULL, '<div>Lack of parental knowledge of what the child is doing or where the child is; poor control; lack of concern or lack of attempted intervention when the child is in risky situations.</div>\n');
INSERT INTO `icd10` VALUES (11087, 4, 11085, 'Z62.1', 'Parental overprotection', NULL, '298', NULL, NULL, NULL, NULL, '<div>Pattern of upbringing resulting in infantilization and prevention of independent behaviour.</div>\n');
INSERT INTO `icd10` VALUES (11088, 4, 11085, 'Z62.2', 'Institutional upbringing', NULL, '298', NULL, NULL, NULL, NULL, '<div>Group foster care in which parenting responsibilities are largely taken over by some form of institution (such as residential nursery, orphanage, or children\'s home), or therapeutic care over a prolonged period in which the child is in a hospital, convalescent home or the like, without at least one parent living with the child.</div>\n');
INSERT INTO `icd10` VALUES (11089, 4, 11085, 'Z62.3', 'Hostility towards and scapegoating of child', NULL, '298', NULL, NULL, NULL, NULL, '<div>Negative parental behaviour specifically focused on the child as an individual, persistent over time and pervasive over several child behaviours (e.g. automatically blaming the child for any problems in the household or attributing negative characteristics to the child).</div>\n');
INSERT INTO `icd10` VALUES (11090, 4, 11085, 'Z62.4', 'Emotional neglect of child', NULL, '298', NULL, NULL, NULL, NULL, '<div>Parent talking to the child in a dismissive or insensitive way. Lack of interest in the child, of sympathy for the child\'s difficulties and of praise and encouragement. Irritated reaction to anxious behaviour and absence of sufficient physical comforting and emotional warmth.</div>\n');
INSERT INTO `icd10` VALUES (11091, 4, 11085, 'Z62.5', 'Other problems related to neglect in upbringing', NULL, '298', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `icd10` VALUES (11092, 4, 11085, 'Z62.6', 'Inappropriate parental pressure and other abnormal qualities of upbringing', NULL, '298', NULL, NULL, NULL, NULL, '<div>Parents forcing the child to be different from the local norm, either sex-inappropriate (e.g. dressing a boy in girl\'s clothes), age-inappropriate (e.g. forcing a child to take on responsibilities above her or his own age) or otherwise inappropriate (e.g. pressing the child to engage in unwanted or too difficult activities).</div>\n');
INSERT INTO `icd10` VALUES (11093, 4, 11085, 'Z62.8', 'Other specified problems related to upbringing', NULL, '298', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `icd10` VALUES (11094, 4, 11085, 'Z62.9', 'Problem related to upbringing, unspecified', NULL, '298', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `icd10` VALUES (11095, 3, 11014, 'Z63', 'Other problems related to primary support group, including family circumstances', NULL, '298', NULL, NULL, NULL, NULL, NULL);
INSERT INTO `icd10` VALUES (11096, 4, 11095, 'Z63.0', 'Problems in relationship with spouse or partner', NULL, '298', NULL, NULL, NULL, NULL, '<div>Discord between partners resulting in severe or prolonged loss of control, in generalization of hostile or critical feelings or in a persisting atmosphere of severe interpersonal violence (hitting or striking).</div>\n');
