INSERT INTO `icd10` VALUES (11376, 3, 11373, 'U06', 'Emergency use of U06', NULL, NULL, NULL, NULL, NULL, NULL, '<div>Codes U00-U49 are to be used by WHO for the provisional assignment of new diseases of uncertain etiology.  In emergency situations codes are not always accessible in electronic systems.  The specification of category U06 in the way it is done here will make sure this category and the subcategories are available in every electronic system at any time and that they can be used upon instruction by WHO, immediately.</div>\n');
