CREATE TABLE `icd10` (
	`id` INT(11) NOT NULL AUTO_INCREMENT,
	`level` INT(11) NOT NULL,
	`parent_id` INT(11) NULL DEFAULT NULL,
	`code` VARCHAR(50) NOT NULL,
	`name` VARCHAR(255) NOT NULL,
	`description` TEXT NULL,
	`mortb_code` VARCHAR(50) NULL DEFAULT NULL,
	`mortl1_code` VARCHAR(50) NULL DEFAULT NULL,
	`mortl2_code` VARCHAR(50) NULL DEFAULT NULL,
	`mortl3_code` VARCHAR(50) NULL DEFAULT NULL,
	`mortl4_code` VARCHAR(50) NULL DEFAULT NULL,
	`note` TEXT NULL,
	PRIMARY KEY (`id`),
	INDEX `FK_icd10_icd10` (`parent_id`),
	CONSTRAINT `FK_icd10_icd10` FOREIGN KEY (`parent_id`) REFERENCES `icd10` (`id`)
)
COLLATE='latin1_swedish_ci'
ENGINE=InnoDB
AUTO_INCREMENT=3650
;


CREATE TABLE `icd10_clusion` (
	`id` INT(11) NOT NULL AUTO_INCREMENT,
	`icd10_id` INT(11) NOT NULL,
	`is_inclusion` BIT(1) NOT NULL,
	`name` VARCHAR(255) NOT NULL,
	`note` TEXT NULL,
	PRIMARY KEY (`id`),
	INDEX `icd10_clusion_FK_icd10` (`icd10_id`),
	CONSTRAINT `icd10_clusion_FK_icd10` FOREIGN KEY (`icd10_id`) REFERENCES `icd10` (`id`)
)
COLLATE='latin1_swedish_ci'
ENGINE=InnoDB
AUTO_INCREMENT=13910
;



